INSERT INTO `dede_addonarticle` VALUES (3555, 5, '<p>\r\n	作者： 来源： 时间：2007-08-14 15:17 阅读：231057 字体大小: [小] [中] [大]&nbsp;<br />\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;&nbsp; 有这么一个故事。<br />\r\n	&nbsp;&nbsp; 在暴风雨后的一个早晨，一个男人来到海边散步。他一边沿海边走着，一边注意到，在沙滩的浅水洼里，有许多被昨夜的暴风雨卷上岸来的小鱼。它们被困在浅水洼里，回不了大海了，虽然近在咫尺。被困的小鱼，也许有几百条，甚至几千条。用不了多久，浅水洼里的水就会被沙粒吸干，被太阳蒸干，这些小鱼都会干死的。<br />\r\n	&nbsp;&nbsp; 男人继续朝前走着。他忽然看见前面有一个小男孩，走得很慢，而且不停地在每一个水洼旁弯下腰去--他在捡起水洼里的小鱼，并且用力把它们扔回大海。这个男人停下来，注视着这个小男孩，看他拯救着小鱼们的生命。<br />\r\n	&nbsp;&nbsp; 终于，这个男人忍不住走过去：&quot;孩子，这水洼里有几百几千条小鱼，你救不过来的。&quot;<br />\r\n	&nbsp;&nbsp; &quot;我知道。&quot;小男孩头也不抬地回答。<br />\r\n	&nbsp;&nbsp; &quot;哦？你为什么还在扔？谁在乎呢？&quot;<br />\r\n	&nbsp;&nbsp; &quot;这条小鱼在乎！&quot;男孩儿一边回答，一边拾起一条鱼扔进大海。&quot;这条在乎，这条也在乎！还有这一条、这一条、这一条&hellip;&hellip;&quot;<br />\r\n	&nbsp;&nbsp; 今天，你们在这里开始大学生活。你们每一个人，都将在这里学会如何去拯救生命。虽然你们救不了全世界的人，救不了全中国的人，甚至救不了一个省一个市的人，但是，你们还是可以救一些人，你们可以减轻他们的痛苦。因为你们的存在，他们的生活从此有所不同--你们可以使他们的生活变得更加美好。这是你们能够并且一定会做得到的。<br />\r\n	&nbsp;&nbsp; 在这里，我希望你们勤奋、努力地学习，永远不要放弃！记住：&quot;这条小鱼在乎！这条小鱼在乎！还有这一条、这一条、这一条&hellip;&hellip;&quot;</p>\r\n<p>\r\n	&nbsp;（这是一位在中国某医学院任职的美国教师的演讲。他在把讲稿让校方过目时，一位领导不知为何竟很不喜欢，让他重写。后来外教还是坚持用了这一篇演讲稿。我想他讲的这个故事也许不仅仅适合医学院学生，所以译过来与大家共享。--译者注）<br />\r\n	&nbsp;<br />\r\n	&nbsp;</p>\r\n', '', '', '127.0.0.1');
