INSERT INTO `dede_addonarticle` VALUES (5617, 106, '<strong>第一章&nbsp; 总则</strong><br />\r\n<strong>第一条</strong>&nbsp; 为了规范和加强学校固定资产管理，维护固定资产的安全完整，合理配置和有效利用固定资产，保障和促进学校各项事业的发展，根据财政部《事业单位国有资产管理暂行办法》及国务院机关事务管理局《中央行政事业单位固定资产管理办法》的有关规定，结合我校的实际情况，制定本办法。<br />\r\n<strong>第二条 </strong>&nbsp;本办法所称的学校固定资产，是指学校占有、使用的，依法确认为国家所有，使用期限较长，单位价值较高，并且在使用过程中保持原有物质形态的资产。<br />\r\n<strong>第三条</strong>&nbsp; 学校固定资产管理的内容主要包括：贯彻执行国家各级政府有关固定资产管理的政策法规，制定并落实学校各类固定资产的管理办法及实施细则；学校固定资产的产权登记、界定、变更及产权纠纷的处理；学校固定资产的账目管理及日常使用管理；固定资产的采购计划审核、验收、调剂、维护维修、处置、评估、审计、清查、统计报表等；固定资产使用管理情况的监督检查；固定资产的出租出借及担保抵押的审批；建立和完善固定资产整合、共享、共用机制以及对非经营性资产转为经营性资产的审批等。<br />\r\n<strong>第二章&nbsp; 固定资产范围、分类及计价</strong><br />\r\n<strong>第四条&nbsp; </strong>使用期限在一年以上，一般设备单位价值在人民币500元以上、专用设备单位价值在人民币800元以上，并在使用过程中能够基本保持原有物质形态的资产，列为学校固定资产。单位价值虽不足规定标准，但耐用时间在一年以上的大批同类物资，按固定资产管理。<br />\r\n<strong>第五条</strong>&nbsp; 学校固定资产分为下列六类：<br />\r\n（一）房屋和建筑物。指学校拥有占有权和使用权的房屋、建筑物及其附属设施。房屋包括教学和科研用房、办公用房、生产经营用房、仓库、职工生活用房、食堂用房、锅炉房等；建筑物包括道路、桥梁、围墙、水塔、雕塑等；附属设施包括房屋、建筑物内的电梯、通讯线路、输电线路及水、气、暖管道等；<br />\r\n（二）专用设备。指根据学校教学科研及其他工作需要购置的各种具有专门性能和用途的设备。包括仪器仪表、机电设备(不含交通运输车辆)、电子设备、印刷设备、文体设备、卫生医疗设备等；<br />\r\n（三）一般设备。指学校的通用设备。包括交通运输车辆、家具、行政办公设备等；<br />\r\n（四）文物及陈列品。指学校拥有或者接受捐赠的各种古物、字画、纪念品等；#p#副标题#e#<br />\r\n（五）图书。指学校图书馆及院系阅览室储藏的、统一管理使用的各类书籍；<br />\r\n（六）其他固定资产。指没有包含在以上各类中的固定资产。&nbsp;(教育部分为十六大类详见《吉林大学固定资产账目管理条例》)<br />\r\n&nbsp;<strong>第六条</strong>&nbsp; 学校固定资产按下列方法计价：<br />\r\n（一）购入、调入的固定资产，按实际支付的买价、调拨价以及运杂费、保险费、安装费、车辆购置附加费等记账；<br />\r\n（二）自行建造的固定资产，按实际发生的支出记账；<br />\r\n（三）在原有固定资产基础上改建、扩建的固定资产，按改、扩建发生的支出减去改建、扩建过程中的变价收入后的净增加值，增记固定资产账；<br />\r\n（四）接受捐赠的固定资产，按照同类固定资产的市场价格或有关凭证记账，接受捐赠时发生的相关费用应计入固定资产价值；<br />\r\n（五）无偿调入的固定资产，不能查明原值的，按照估价入账；<br />\r\n（六）盘盈的固定资产，按照重置完全价值入账；<br />\r\n（七）已投入使用的新增固定资产，按决算凭证记账；<br />\r\n（八）用外币进口的设备，按当时的汇率折合成人民币金额，加上国外部分的运费及其它费用(外币应折合成人民币金额)，再加上支付的关税、海关手续费等计价入账；<br />\r\n（九）购置固定资产过程中发生的差旅费，不计入固定资产价值。<br />\r\n<strong>第七条</strong>&nbsp; 学校固定资产不实行折旧，按原值入账。<br />\r\n&nbsp;<strong>第八条</strong>&nbsp; 已经入账的固定资产除发生下列情况外，不得任意变动固定资产账面价值：<br />\r\n（一）根据国家规定对固定资产进行重新估价的；<br />\r\n（二）增加补充设备或改良装置的；<br />\r\n（三）将固定资产一部分拆除的；<br />\r\n（四）根据实际价值调整原来暂估价值的；<br />\r\n（五）发现原来记录固定资产价值有误的。<br />\r\n<strong>第九条</strong>&nbsp; 上级主管部门另有规定的，依照其规定。#p#副标题#e#<br />\r\n<strong>第三章&nbsp; 固定资产管理体制、机构及职责</strong><br />\r\n<strong>第十条</strong>&nbsp; 学校固定资产的管理实行校院（中心、部、处、所、独立的科研机构等）两级管理体制，实行产权产籍管理与日常使用管理相分离的模式，实行固定资产管理责任人制度。学校固定资产管理部门主要负责固定资产产权产籍管理；学校固定资产日常使用管理由相关归口管理部门和各使用单位负责<br />\r\n<strong>第十一条&nbsp; </strong>资产管理与后勤处是学校固定资产管理的职能部门，其主要职责是：<br />\r\n（一）参与学校发展规划、年度计划的研究制定，贯彻落实国家国有资产的政策法规，组织制定学校固定资产管理制度和各项规定；<br />\r\n（二）组织落实学校固定资产管理内容涵盖的各项工作；<br />\r\n（三）监督学校固定资产的使用和保值增值情况；<br />\r\n（四）监督学校转企改制单位固定资产的管理工作；<br />\r\n（五）负责全校固定资产管理队伍的工作指导和业务培训；<br />\r\n（六）学校固定资产管理的其他工作。<br />\r\n<strong>第十二条&nbsp; </strong>学校国有资产管理由资产管理与后勤处统一领导下，使用单位负责的固定资产使用管理工作。<br />\r\n<strong>第十三条&nbsp; </strong>相关归口管理部门和各学院（中心、部、处、所、独立的科研机构等）作为学校固定资产的二级管理单位，其主要职责是：<br />\r\n（一）认真贯彻落实学校固定资产管理的各项规章制度，制定本部门和本单位固定资产管理实施细则；<br />\r\n（二）设立专职或兼职的固定资产管理人员，落实管理责任人制度，<br />\r\n（三）按照学校固定资产管理部门的要求，建立二级固定资产账目，并根据需要在内部设立三级固定资产账目。<br />\r\n（四）管理好本部门和本单位固定资产的账目、卡片及实物，定期做好账物盘查，确保账、卡、物相符。<br />\r\n（五）二级管理单位通过学校国有资产综合管理平台完成固定资产数据统计和固定资产报表。<br />\r\n<strong>第四章&nbsp; 固定资产配置及使用</strong><br />\r\n<strong>第十四条 </strong>学校固定资产配置是指学校根据校内单位履行职能的需要，通过购置或者调剂等方式为校内单位配备固定资产的行为。#p#副标题#e#<br />\r\n<strong>第十五条 </strong>学校配备固定资产应当符合下列条件：<br />\r\n（一）现有固定资产无法满足单位履行职能的需要；<br />\r\n（二）难以与其他单位共享、共用相关固定资产；<br />\r\n（三）难以通过市场购买产品或服务的方式代替固定资产配置，或者采取市场购买方式的成本过高。<br />\r\n<strong>第十六条 </strong>校内单位固定资产配置应当符合规定的配置标准；没有规定配置标准的，学校固定资产管理部门应当从严控制，合理配置。<br />\r\n<strong>第十七条 </strong>&nbsp;对于校内单位长期闲置、低效运转或者超标准配置的固定资产，原则上由固定资产管理部门在校内进行调剂。需要跨校调剂的，应当报上级主管部门批准。<br />\r\n<strong>第十八条 </strong>学校固定资产的使用包括校内单位自用和对外投资、出租、出借、担保等方式。<br />\r\n<strong>第十九条 </strong>学校固定资产管理部门应当对学校固定资产进行定期清查，做到帐卡、帐实相符。<br />\r\n<strong>第二十条 </strong>利用学校固定资产对外投资、出租、出借和担保等，应当进行必要的可行性论证，按规定的程序进行审批，并实行专项管理。<br />\r\n<strong>第二十一条 </strong>利用学校固定资产对外投资的收益以及出租、出借和担保等取得的收入应当纳入学校预算，统一核算，统一管理。#p#副标题#e#<br />\r\n<strong>第五章&nbsp; 固定资产增减变动</strong><br />\r\n<strong>第二十二条</strong>&nbsp; 购入、调入、自制、自建完工交付使用增加的固定资产，必须由学校固定资产管理部门统一组织验收。验收合格后，使用单位持相关凭证到固定资产管理部门填写固定资产增加凭单。<br />\r\n<strong>第二十三条</strong>&nbsp; 接受捐赠或盘盈的固定资产，应由学校固定资产管理部门办理接收和交接，并依据相关凭证填写固定资产增加凭单。<br />\r\n&nbsp;<strong>第二十四条&nbsp; </strong>固定资产的减少(出售、出让、转让、报废、毁损、盘亏、对外捐赠、投资、抵债等)必须经学校固定资产管理部门审批后，填写固定资产减少凭单。<br />\r\n<strong>第六章 固定资产处置</strong><br />\r\n<strong>第二十五条 </strong>学校固定资产处置，是指学校对其占有、使用的固定资产进行产权转让或者注销产权的行为。处置方式包括出售、出让、转让、对外捐赠、报废、报损、抵债等。<br />\r\n<strong>第二十六条 </strong>学校处置固定资产，由学校国有资产管理部门负责组织实施，应当严格履行审批手续，校内任何单位和个人未经批准不得自行处置。<br />\r\n<strong>第二十七条 </strong>学校固定资产处置的批复文件作为学校调整固定资产帐目和会计账目的凭证。<br />\r\n<strong>第二十八条 </strong>学校固定资产处置应当遵循公开、公正、公平的原则。<br />\r\n单位价值较大，技术含量较高的固定资产处置，应当组织相关专家论证。<br />\r\n出售、出让、转让、变卖固定资产数量较多或者价值较高的，须由学校党委常委会集体讨论决定，并应当通过市场竞价方式公开处置。<br />\r\n<strong>第二十九条 </strong>学校固定资产处置的收入属学校所有，应当按有关规定，实行&ldquo;收支两条线&rdquo;管理。<br />\r\n<strong>第七章固定资产信息管理与报告</strong><br />\r\n<strong>第三十条 </strong>学校固定资产管理部门和使用单位应当按照国有资产管理信息化的要求和各自授权范围，及时、准确地将固定资产变动信息录入管理信息系统，对固定资产实行动态管理，并在此基础上做好学校固定资产数据统计和信息报告工作。<br />\r\n<strong>第三十一条 </strong>学校固定资产管理部门应当利用管理信息系统和校内单位固定资产信息报告，全面、动态地掌握校内各单位固定资产配备和使用情况，并建立和完善学校固定资产配置与使用有效结合的激励机制和约束机制。<br />\r\n<strong>第八章&nbsp; 附则</strong><br />\r\n<strong>第三十二条</strong>&nbsp; 本办法自发布之日起实行。2001年4月12日印发的《吉林大学固定资产管理办法》(校字[2001]65号)同时废止。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '', '', '211.151.238.51');
