INSERT INTO `dede_addonarticle` VALUES (5665, 140, '为吸引优秀人才来我校工作，稳定人才队伍，经研究决定，建设优秀人才周转房，现就有关周转房管理事宜规定如下：<br />\r\n1、管理原则：<br />\r\n&nbsp;&nbsp;&nbsp; 统一建设，统一调配，统一管理。<br />\r\n2、周转房的使用对象：<br />\r\n⑴《吉林大学吸引优秀人才暂行办法》（试行）确定的人才；<br />\r\n&nbsp;&nbsp;&nbsp; ⑵进站博士后人员。<br />\r\n3、周转房的申请办法：<br />\r\n⑴个人向其所在单位提出申请；<br />\r\n⑵引进人才所在单位负责人签字并加盖公章后向人事处提出书面申请；进站博士后所在单位负责人签字并加盖公章后向研究生院提出书面申请；<br />\r\n⑶人事处或研究生院认定后，报房管部门调配住房。<br />\r\n4、周转房的使用办法：<br />\r\n周转房的使用人经有关部门同意后，需与房管部门签订协议，并交纳保证金后方可使用。周转房只租不售，房租由房管部门向使用人按月收取或学校财务处从使用人工资中直接扣出。<br />\r\n5、保证金标准：<br />\r\n二室住房：15000.00元；<br />\r\n三室住房：20000.00元。&nbsp;<br />\r\n6、转房的周转期：<br />\r\n周转期一般不超过3年。<br />\r\n7、周转房的租金标准：<br />\r\n二室住房：1500.00元/月；<br />\r\n三室住房：2000.00元/月。<br />\r\n8、租金收缴方式：<br />\r\n所需租金由学校财务部门按月在使用人的工资中扣除，不足部分由使用人直接交纳。<br />\r\n9、周转房的租金补贴：<br />\r\n在周转期内，学校为周转房的使用人提供租金补贴，即：<br />\r\n二室住房：1200.00元/月；<br />\r\n三室住房：1600.00元/月。<br />\r\n超过周转期时，学校不再为使用人提供租金补贴，周转房的租金由使用人全额负担。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
