INSERT INTO `dede_addonarticle` VALUES (5667, 139, '为规范水、电、查收、燃气费抄收的管理工作，严肃财务纪律，提高水、电、燃气费抄收的管理水平，根据有关规定，特制定本制度。<br />\r\n第一部分&nbsp; 水、电、燃气费的抄收范围<br />\r\n1、产业处所属各校办产业；<br />\r\n2、后勤服务集团所属各专业中心、各校区后勤服务中心和代管的各就业服务中心；<br />\r\n3、具有经营服务活动的单位或个人；<br />\r\n4、利用学校房舍与学校合作办学等活动单位或个人；<br />\r\n5、对外加工单位或个人；<br />\r\n6、校园绿化、房舍清洗、车辆清洗等；<br />\r\n7、基建工地、房产修缮工地、装潢工程施工；<br />\r\n8、其它学校认定需查收水、电、燃气费的单位或个人。<br />\r\n第二部分 抄收管理<br />\r\n&nbsp;&nbsp;&nbsp; 1、抄收人员认真填写水、电、燃气抄收账卡，账卡要用钢笔或碳素笔填写，字迹工整、清楚，不准随意涂改，因误写需要改写的，在改写处加盖经办人名章；<br />\r\n&nbsp;&nbsp;&nbsp; 2、对抄收用户全部安装水、电计量表，按表收费。对暂不具备安装水、电表条件的用户，可根据设备容量、管道流量及使用时间测算用量后收费；<br />\r\n3、收费标准：水费按长春市行业标准，电费按长春市行业标准或按该计量表所在一次电表平均电价收费。特殊情况须调整收费标准的必须请示领导批准；<br />\r\n4、一次水、电、燃气表每月抄表一次，一次电表每二月抄表一次，一次燃气表每月抄表一次，二次水、电表每二月抄表一次；<br />\r\n5、基建工地每月抄表一次，所抄表数须经工地管理人员确认；<br />\r\n6、安装IC卡预付费电能表用户，按《IC卡预付费电能表系统管理办法（试行）》规定抄收电费；<br />\r\n7、抄收人员要认真履行职责，抄收帐目字迹工整、清楚，帐卡编号码齐全并加盖公章及主任名章。增减用户、建帐撤卡须经主任批准；<br />\r\n8、认真检查用户水、电、燃气的使用情况，发现问题及时处理并要及时汇报；<br />\r\n9、抄收人员要按财务规定程序领取票据，并妥善保管。填写票据要字迹工整、清楚，按规定复写。帐卡页码要齐全，单册票据用完后及时上缴财务处，避免丢失。票据如有丢失应及时报告，并说明情况；<br />\r\n10、对经营单位每季度收缴水、电、燃气费一次，如有特殊情况须经领导批准后可年底一次性收缴。对个人从事经营的每月收缴水、电费一次，如有特殊情况须经领导批准后按批准期限收缴，不准拖延。<br />\r\n11、收费人员对所收钱款要认真验别真伪并妥善保管，如收有假币或丢失个人负责。所收取钱款要当日上缴财务处，如有特殊情况不能按时上缴的，要应按财务有关规定妥善处理。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5678, 5, '<strong>姓名：赵&nbsp; 伟 </strong><br />\r\n学历：博士<br />\r\n行政级别：正处级<br />\r\n职务 ：教授<br />\r\n电话 85167478<br />\r\n邮箱 <a href="mailto:zhao_wei@jlu.edu.cn">zhao_wei@jlu.edu.cn</a><br />\r\n办公地点 ：吉林大学前卫南区商贸楼307-1室<br />\r\n<br />\r\n工作职责：&nbsp; 负责全面工作，主管资产、后勤工作。', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5686, 94, '<p>\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<samp>&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;我校荣获&ldquo;吉林省公共机构节能工作先进单位&rdquo;，同时节能办公室科长刘长有、温凤义荣获吉林省公共机构节能工作先进个人&rdquo;。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;此次评选是吉林省政府为表彰在建设全省节约型社会建设中做出了突出贡献的公共机构及个人，进一步调动全省公共机构开展节能工作的积极性，发挥公共机构在建设节约型社会中的表率带头作用，鼓励全省各级公共机构以及工作人员要以受到表彰的先进单位和先进个人为榜样，积极行动，扎实工作，全面提高全省公共及结构节能工作科学管理水平，为实现全省经济社会又快又好发展做出新的更大的贡献。</samp></span><br />\r\n	<br />\r\n	&nbsp;</p>\r\n<p style="text-align: center">\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 16px">&nbsp;&nbsp;&nbsp; &nbsp;资产管理与后勤处<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; 2013年5月2日</span><br />\r\n	<br />\r\n	&nbsp;</p>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5648, 109, '<p>\r\n	根据《关于印发&lt;吉林大学科级干部民主测评办法&gt;并组织开展科级干部民主测评工作的通知》及《吉林大学科级干部民主测评办法》日程安排，拟于2013年4月27日开展资产管理与后勤处科级干部述职考评会议，现将有关事宜通知如下：<br />\r\n	1.述职地点：数学楼二楼多功能厅。<br />\r\n	2.述职时间:4月27日，上午8:30-11:30，下午13:30-16:30。<br />\r\n	3.述职范围：全处科级干部（包括正、副科秘）。<br />\r\n	4.请全处职工于当日上午8:20、下午13:20到相应地点等候。<br />\r\n	5.每人陈述时间为5分钟。<br />\r\n	6.述职内容：任现职以来特别是近四年来在德、能、勤、绩、廉等方面的现实表现，履行岗位职责情况。<br />\r\n	&nbsp;&nbsp;&nbsp;<br />\r\n	请大家认真准备述职报告，准时参加会议。<br />\r\n	&nbsp;</p>\r\n<p style="text-align: right">\r\n	&nbsp; 资产管理与后勤处</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013年4月24日<br />\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5669, 126, '根据学校的有关规定，结合资产管理与资产管理与后勤处实际情况，特制定《资产管理与资产管理与后勤处考勤管理制度》，本制度是工作正常运转的保障机制，是提高工作效率的重要措施，资产管理与资产管理与后勤处全体人员必须严格遵守。本制度于颁布之日起实行。<br />\r\n二、考勤管理<br />\r\n1、每天上班必须先到处办及校区办公室公室填出勤表，不准弄虚作假。<br />\r\n2、因事不能及时签到，须电话通知办公室，回处后应补签。<br />\r\n3、上班期间有事离开办公室，要向办公室说明去向、停留时间。<br />\r\n4、每月底办公室汇总后存档。<br />\r\n5、考勤情况与年终考核挂钩。<br />\r\n三、请假程序与权限<br />\r\n6、工作人员：<br />\r\n一天假须经所在科室科长主任批准。<br />\r\n二天假须经主管处长批准。<br />\r\n三天假须经处长批准。<br />\r\n7、科级干部：<br />\r\n一天假须经主管处长批准。<br />\r\n二天假以上须经处长批准。<br />\r\n8、处级干部：<br />\r\n三天以内假由处长批准。<br />\r\n四天以上报请主管校领导批准。<br />\r\n离长春需1天以上由校长批准。&nbsp;&nbsp;<br />\r\n四、迟到、早退与旷工处理<br />\r\n9、根据学校人事处有关管理规定处理。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5670, 126, '为了使室容、室貌清新、整洁，体现出资产管理与资产管理与后勤处的良好精神面貌，特制定本办法。<br />\r\n1、室容、室貌由处办公室负责统一安排，各科轮流组织检查。<br />\r\n2、检查时间：每月初进行一次全面检查，本月内进行三次抽查。<br />\r\n3、检查的结果计入检查表，做为年底各科考核的内容之一。<br />\r\n4、各科室每天要认真清扫和整理办公室，检查人员要认真负责。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5671, 126, '为加强档案管理，做好文件的立卷、归档工作，特制定如下规定：<br />\r\n一、处办公室负责资产管理与资产管理与后勤处及各科文书档案的<br />\r\n整理及归档，做到认真、严谨、保密。<br />\r\n二、文书档案范围包括：各种文件、行文、信<br />\r\n函、制度、后勤基础数据等。<br />\r\n三、要及时做好各种文件、报告的收发、分类登记、保存工作，按时整理归档。<br />\r\n四、主动与学校档案主管部门沟通，并经常接受其监督和指导。<br />\r\n五、做好每年的档案立卷和归档工作。<br />\r\n六、一般档案由资产管理与资产管理与后勤处自管，重要档案由学校档案馆统一保管。<br />\r\n七、档案的收集、整理、分类、编目、立卷、归档要及时、准确。严禁有重要档案丢失和漏存现象发生。<br />\r\n八、各科室要积极配合工作，主动提供资料，参阅的文件要及时返还，重要的文件、图表、数据要报送处办公室存档。<br />\r\n九、档案管理实行专人管理、专人负责制度。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5701, 102, '<ul>\r\n	<li>\r\n		负责全处的信息化建设，信息系统维护以及信息资源管理工作；制定并落实全处信息管理的规章制度，保证处内信息系统的正常运行。</li>\r\n	<li>\r\n		负责《吉林大学能源监管平台》的续建、维护、管理，为校内各单位提供水、电、暖、燃气消耗量等数据，并进行数据分析、统计工作。</li>\r\n	<li>\r\n		负责《吉林大学能源信息化平台》的续建、维护、管理，为下级单位提供水、电消耗分项数据。</li>\r\n	<li>\r\n		负责《吉林大学国有资产管理系统》的续建、维护、管理工作。</li>\r\n	<li>\r\n		负责《吉林大学职工住房管理系统》的续建、维护、管理工作。</li>\r\n	<li>\r\n		负责《吉林大学三维数字校园管理系统》的续建、维护、管理，为全校园绿化管理，工程维修，基础设施建设，地下管线布局提供数据支持。</li>\r\n	<li>\r\n		负责处内各类服务器的维护管理工作。</li>\r\n	<li>\r\n		负责处内网络运行、维护安全防范以及管理工作。</li>\r\n	<li>\r\n		负责处内各系统的用户使用权限和用户管理，落实信息保密制度。</li>\r\n	<li>\r\n		负责制定处内信息系统培训计划，并组织有关部门开展培训。</li>\r\n	<li>\r\n		负责处内信息数据统计分析、研究工作，提供数据统计分析报告和各类统计报表。</li>\r\n	<li>\r\n		完成领导交办的其他工作。</li>\r\n</ul>\r\n科室成员<br />\r\n科长 ：王泽一&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;办公地点：前卫南区商贸楼302 &nbsp;电话：85166542&nbsp;<br />\r\n副科长：解丹&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公地点：前卫南区商贸楼405&nbsp;&nbsp;电话：85166136<br />\r\n<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5702, 102, '<ol>\r\n	<li>\r\n		全面负责全校供水、供电、供暖及供气的服务和管理工作。保障学校的教学、科研和日常工作的顺利进行。</li>\r\n	<li>\r\n		全面监控学校锅炉房、变电室及给水泵房的运行情况，搜集各类设备、设施的工作状态，制定运行标准与考核办法，制定设备及系统的维护与保养计划，提出维修改造方案及工程概算。</li>\r\n	<li>\r\n		全面监控供水、供电及供暖的外网系统，掌握外网系统的管道及线路的工作状态，保障用水、用电和采暖的安全，正常运行。制定维护保养计划，提出维修改造方案和工程概算。</li>\r\n	<li>\r\n		全面检查并掌握全校的空调系统，对系统中的设备设施及配件制定维护保养计划，提出维修改造方案和工程概算。</li>\r\n	<li>\r\n		负责组织突发停水，停电，停暖等突发事件的抢修。</li>\r\n	<li>\r\n		负责动力维修工程中的施工安全和工程管理工作，提高设备设施利用率和使用周期。</li>\r\n	<li>\r\n		负责动力系统维修工程的验收，决算，信息反馈及工程交接工作。</li>\r\n	<li>\r\n		负责与政府供水、供电、供暖等部门的协调工作。</li>\r\n	<li>\r\n		负责全校采暖管理，供热面积核定和热费缴纳工作。</li>\r\n	<li>\r\n		完成处里交办的其他事宜。</li>\r\n</ol>\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5703, 102, '<div>\r\n	<span style="font-size: 16px">一、负责研究国家、吉林省及长春市有关住房制度法律、法规和政策，制定学校职工住房制度改革方案及配套措施。<br />\r\n	二、负责学校住房信息系统的建设、管理和维护。<br />\r\n	三、负责学校住房制度改革工作。<br />\r\n	四、负责学校无籍房、集资房产权备案工作。<br />\r\n	五、负责办理职工个人房屋所有权证，处理房改遗留问题。<br />\r\n	六、负责学校教职工及遗属采暖补贴发放工作。<br />\r\n	七、负责学校危旧住房改造及保障性住房政策的落实。<br />\r\n	八、负责学校职工住房调配、管理。<br />\r\n	九、负责学校职工住宅售房资金管理及使用审批。<br />\r\n	十、负责做好公有住房售后管理工作，探讨物业管理模式，组织实施住宅小区物业管理。<br />\r\n	十一、做好房产管理日常工作。<br />\r\n	十二、完成领导交办的其他工作。</span><br />\r\n	&nbsp;</div>\r\n<div style="text-align: center">\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</div>\r\n', '', '', '59.72.106.140');
INSERT INTO `dede_addonarticle` VALUES (5584, 102, '1.负责研究国家、吉林省及长春市有关住房制度法律、法规和政策，制定学校职工住房制度改革及配套措施；<br />\r\n2.负责建立全校统一的住房管理系统；<br />\r\n3.负责学校住房制度改革；<br />\r\n4.负责学校无籍房产权办理及职工住宅公有住房出售；<br />\r\n5.负责学校危旧住房改造；<br />\r\n6.负责学校新征用土地、动迁、拆迁；<br />\r\n7.负责学校职工住房调配、管理；<br />\r\n8.负责学校职工住宅售房资金管理及使用审批；<br />\r\n9.负责做好公有住房售后管理工作；<br />\r\n10.做好房产管理日常工作；<br />\r\n11.完成领导交办的其他工作。<br />\r\n', '', '', '59.72.109.100');
INSERT INTO `dede_addonarticle` VALUES (5585, 102, '1.负责制定各项节能节水规章制度，拟定节能节水规划和方案；<br />\r\n2.负责水、电、燃气年度经费支出和回收经费计划的编制；<br />\r\n3.负责制定水、电、燃气费收费标准，完成水、电、燃气费回收工作；<br />\r\n4.负责各单位水、电、燃气能耗的调研和定额制定工作；<br />\r\n5.负责节能节水专项工程预（决）算的编制和审定工作；<br />\r\n6.负责贯彻执行有关节能节水政策及与相关部门联系工作；<br />\r\n7.负责学校水、电、燃气一、二次计量表管理工作；<br />\r\n8.负责新设备、新技术、新产品的考核、调研、推广及应用；<br />\r\n9.节能节水宣传工作；<br />\r\n10负责水、电、燃气支出及回收经费台帐、建档及有关资料的管理；<br />\r\n11.负责各校区售电服务站各项管理工作。<br />\r\n', '', '', '59.72.109.100');
INSERT INTO `dede_addonarticle` VALUES (5586, 102, '1.负责组织动员校内各单位开展爱国卫生运动；<br />\r\n2.负责组织对校内各单位开展的爱国卫生运动情况进行监督检查、评比工作；<br />\r\n3.负责组织对学校的食品卫生安全、二次供水卫生安全及校园内经营性场所的卫生安全监督、检查工作；<br />\r\n4.负责组织学校健康教育宣传普及等工作；<br />\r\n5.负责学校病媒生物防治管理工作；<br />\r\n6.负责学校冬季清雪的管理工作。<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5587, 102, '1.负责学校房屋修缮、基础设施改造及零星添建等工程的计划、立项、招标、竣工验收、交接和预、决算的审核工作；<br />\r\n2.负责修缮工程的质量、进度和投资全过程控制与管理<br />\r\n3.负责学校热源设备改造维修、采暖运行及集中供热付费的管理工作；<br />\r\n4.负责学校电梯、空调机组、通风系统等大修工作；<br />\r\n5.负责学校高压变电所、变电站、储水池及泵站等维修改造工程；<br />\r\n6.负责学校修缮专项的申报工作；<br />\r\n7.负责学校教室桌椅和黑板的配置工作；<br />\r\n8.负责监督、检查对应后勤服务经营实体在保障服务过程中的服务质量及任务完成情况；<br />\r\n9.完成处领导交办的其它任务。<br />\r\n<br />\r\n科室成员：<br />\r\n科长&nbsp;：毕克才&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公地点：前卫南区商贸楼301&nbsp; 电话：85166545<br />\r\n副科长：&nbsp;王洪明&nbsp;&nbsp;&nbsp;&nbsp; 办公地点：前卫南区商贸楼301&nbsp; 电话：85166545<br />\r\n工作人员：梁晓兰&nbsp;&nbsp;办公地点：前卫南区商贸楼301&nbsp; 电话：85166545<br />\r\n工作人员：冯海满 办公地点：前卫南区商贸楼301&nbsp; 电话：85166545<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5588, 102, '1.制定学校校园管理的各项规章制度，并监督执行；<br />\r\n2.负责学校年度绿化、美化工程计划的制定；<br />\r\n3.负责学校环境工程质量监督及工程验收工作；<br />\r\n4.负责检查、监督后勤服务实体完成校园卫生、绿化、保洁等方面工作；<br />\r\n5.负责学校校园管理运行经费预算的编报工作；<br />\r\n6.负责学校校园（含家属区）环境建设总体规划的设计；<br />\r\n7.负责学校校园基础数据的普查及建档工作；<br />\r\n8.负责学校全民义务植树工作；<br />\r\n9.完成领导交办的其他工作。<br />\r\n<br />\r\n<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5590, 102, '1、负责学校固定资产总帐和房屋及构筑物、土地、家具、被服装具分类总帐及分户帐的管理，及时提供准确详实的报表、报盘。<br />\r\n2、制定学校固定资产的各项管理规章制度并组织实施、监督和检查。<br />\r\n3、负责学校固定资产验收、调剂、转让、处置等工作。<br />\r\n4、负责组织开展全校固定资产清查和固定资产管理专项稽查及使用效益考核工作。<br />\r\n5、负责学校教学、科研及行政办公等家具配置标准的制定和添置计划的审核工作。<br />\r\n6、负责学校资产管理平台系统维护。<br />\r\n7、完成处领导交办的其他工作。<br />\r\n&nbsp;<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5591, 102, '一、根据国家政策法规，制定学校无形资产管理规章制度，并组织实施和监督检查。<br />\r\n二、负责组织无形资产的清查、登记、分类汇集和建帐。<br />\r\n三、组织开展知识产权宣传、教育、培训工作。<br />\r\n四、开展知识产权对外交流与合作。<br />\r\n五、计算机软件著作权的申请、登记、转让等工作。<br />\r\n六、学校商标注册及商业用途使用学校注册商标的审核及监督管理。<br />\r\n七、学校使用无形资产进行投资的决策。<br />\r\n八、在知识产权保护工作中应当履行的职责。<br />\r\n九、完成的其他工作。<br />\r\n<br />\r\n<br />\r\n科室成员<br />\r\n<br />\r\n科长：李建&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公地点：前卫南区商贸楼406室&nbsp; 电话：85151085<br />\r\n工作人员：王立文&nbsp; 办公地点：前卫南区商贸楼406室&nbsp; 电话：85151085<br />\r\n<br />\r\n', '', '', '59.72.106.140');
INSERT INTO `dede_addonarticle` VALUES (5592, 102, '1、学校国有资产产权的认定、核准、登记、变更等相关业务的管理。<br />\r\n2、非经营性资产转为经营性资产的审核。<br />\r\n3、对经营性资产（包括学校对外投资形成的资产和股权）的核查、登记、统计评估、效益考核等监督管理，学校分成部分利润的收缴。<br />\r\n4、学校投入校办企业的资产产权管理，资产的核查与效益评估，收缴企业应上交学校部分的利润。<br />\r\n5、用于经营活动（含出租、出借）资产的审批、协议签订和收费。<br />\r\n6、学校不良资产和坏账的审核与处置。<br />\r\n7、完成处领导交办的其他工作。<br />\r\n&nbsp;<br />\r\n科室成员<br />\r\n<br />\r\n科长：曹志杰&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公地点 ：前卫南区商贸楼402室 电话：85151099<br />\r\n副科长：陈妹&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;办公地点 ：前卫南区商贸楼402室 电话：85151099<br />\r\n工作人员：安晶玉 办公地点 ：前卫南区商贸楼402室 电话：85151099<br />\r\n<br />\r\n<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5593, 102, '1、 贯彻执行国家和学校关于公用房管理的法规和政策。<br />\r\n2、 起草有关学校公用房管理的规章制度。<br />\r\n3、 学校新建公用房的验收，并办理使用交接手续。<br />\r\n4、 制定学校公用房产的配置计划和使用调整方案。<br />\r\n5、 审核校内各单位用房申请，提出调配意见，签订用房协议，办理调配手续。<br />\r\n6、 学校公用房资料的收集、整理、存档、维护。<br />\r\n7、 公用房使用的检查监督，对违规使用的公用房提出整改意见。<br />\r\n8、 负责校内各单位用房的核定、测算，配合财务处收缴各单位超定额用房的使用费。<br />\r\n9、 完成上级领导交办的其他工作。<br />\r\n&nbsp;<br />\r\n科室成员：<br />\r\n科长：王昆雷&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;办公地点：前卫南区商贸楼401室&nbsp; 电话：85166989<br />\r\n副科长：马鑫磊 &nbsp;办公地点：前卫南区商贸楼401室&nbsp; 电话：85166989<br />\r\n工作人员：付斌&nbsp;&nbsp; 办公地点：前卫南区商贸楼401室&nbsp; 电话：85166989<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5595, 102, '1、负责起草处年度工作计划、总结等文字材料，建立完善处内工作规章制度。<br />\r\n2、负责处内人事管理、公文管理、会议管理、印鉴管理、档案管理、保密管理、固定资产管理、办公用品管理等行政管理工作。<br />\r\n3、负责处内人员考勤、统计报表、办公区卫生安全、公务交通安排、工会、综合治理等日常事务性工作。<br />\r\n4、负责处内经费的财务管理。<br />\r\n5、负责处内工作督办、协调、反馈和对外接待工作。<br />\r\n6、负责处办公网页的日常管理和维护，信息收集、汇总和发布。<br />\r\n7、负责学校国有资产管理委员会日常工作。<br />\r\n8、完成处领导交办的其他工作。<br />\r\n<br />\r\n科室成员<br />\r\n科长 ：王泽一&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公地点：前卫南区商贸楼302 &nbsp; 电话：85166542&nbsp;<br />\r\n副科长：于淑杰&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;办公地点：前卫南区商贸楼302&nbsp;&nbsp;&nbsp;电话：85166542<br />\r\n工作人员：吕红怡 办公地点：前卫南区商贸楼304&nbsp;&nbsp; 电话：85166542<br />\r\n工作人员：孙振涛 办公地点：前卫南区商贸楼304&nbsp; &nbsp;电话：85166542<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;<br />\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (4645, 5, '<P align=left><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2003</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">年是贯彻十六大精神，落实</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">三个代表</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">重要思想，推进教育创新，加快学校发展步伐的重要一年。妇女组织作为党联系妇女群众的桥梁纽带，在加强</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">三个文明</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">建设协调发展，参与学校民主管理、维护妇女合法权益等方面负有重要使命和职责。</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR></SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">一、基本思路</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2003</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">年学校妇女工作的基本思路是：在校党委领导下，根据</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">三个代表</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">重要思想的要求，紧紧围绕学校工作的全局，以</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">巾帼建功</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">务求实效，妇女发展创先争优为基点，充分发挥妇委会职能，广泛团结凝聚全校妇女，在发展学校、建设学校、推进学校全面进步中创建新业绩，做出新贡献。</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR></SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">二、重点开展的几项工作</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR></SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">（一）用十六大精神统一思想，扎实推进岗位竞赛</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">巾帼建功</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">活动的深入开展。</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>1</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、组织召开处级女领导干部座谈会，结合工作实际畅谈十六大精神学习体会，为学校改革建设献计献策，共谋发展。（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">1</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>2</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、举办十六大专题辅导报告；引导广大妇女把握灵魂，抓住精髓，真正把思想和行动统一到十六大精神上来，把十六大精神落实到妇女工作的方方面面；（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">5</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>3</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、举办庆</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">三八</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">系列活动；（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">3</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR></SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">1</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">）召开</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">巾帼建功</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">总结表彰大会；</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR></SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">2</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">）举办</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">巾帼建功</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">先进事迹巡徊报告会；</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>4</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、落实《公民道德建设实施纲要》，开展特色家庭美德创建活动；（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">10</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>5</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、加强妇女干部参政议政力度，做好妇女干部人才库的筹建工作；（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">4</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast