uage: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">儿童节庆祝活动，实施</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">春蕾计划</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">和</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">“</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">安康计划</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">”</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">；（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">6</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>4</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、关心病困女职工和有特殊困难的女大学生、女研究生，走访慰问并帮助她们解决实际问题。（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">12</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR></SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">（六）完成学校党委和上级妇联交办的其它各项工作任务，宣传贯彻全国妇联第九次妇女代表大会及省、市妇代会精神。（全年）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>1</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、贯彻落实全国妇代会精神，召开妇女干部座谈会；（待定）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>2</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、响应省市妇联号召，开展三送三下活动；（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">8</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR><BR>3</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">、发挥高校优势，加强军民共建，组织军民联谊活动。（</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA">8</SPAN><SPAN style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial">月份）</SPAN><SPAN lang=EN-US style="FONT-SIZE: 9pt; COLOR: #4c4c4c; FONT-FAMILY: Arial; mso-fareast-font-family: 宋体; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA"> <BR style="mso-special-character: line-break"><BR style="mso-special-character: line-break"></P></SPAN>', '', '', '127.0.0.1');
