INSERT INTO `dede_addonarticle` VALUES (5605, 94, '2013年4月11日，我处收到吉林大学超硬材料国家重点实验室发来的感谢信，内容如下：<br />\r\n<br />\r\n吉林大学资产管理与后勤处：<br />\r\n你们好！<br />\r\n&nbsp;&nbsp;&nbsp; 北国的春天乍暖还寒，今年3月我实验室迎来了五年一度的国家重点实验室评估工作，为了确保实验室评估工作的顺利进行，工程队的领导高度重视、所有职工不辞劳苦，出色完成了后勤保障工作。<br />\r\n&nbsp;&nbsp;&nbsp; 资产管理与后勤处确保实验室评估工作的顺利进行，2月份就积极投入工作，为实验室特地准备了清洁工具，使师生们顺利完成实验室的清洁工作；保洁人员放弃了放假休息时间、每天坚持清扫，就连除夕当天也坚持上班，临近评估，增加了工作量他们也毫无怨言，保证了实验室的卫生清洁；门卫人员也没有放假休息，确保了实验室的安全；电工师傅几乎每天到实验室一趟，实验室从一楼到六楼室内有不亮他都及时修理，保障了实验室的照明工作；今年长春下了近40场雪，积雪很厚，后勤处集中了200多名员工抢在2天内完成了积雪清扫工作，付出了艰辛的劳动；维修队积极投入工作，实验室的门窗的维修，实验室电源、配电等设施的修缮工作，保证了实验室的墙体整洁；消除了用电安全的隐患，恢复门窗把手的正常使用，是实验室焕然一新，保障了实验室评估工作的顺利进行。<br />\r\n&nbsp;&nbsp;&nbsp; 后勤处的领导和同志们心系实验室发展大局，主动提供尽可能的服务，超硬材料国家重点实验室对后勤处的周到服务表示衷心的感谢，对领导和员工们认真、热情服务态度致以崇高的敬意。<br />\r\n<br />\r\n<br />\r\n<div style="text-align: right">\r\n	吉林大学超硬材料国家重点实验室</div>\r\n<div style="text-align: right">\r\n	2013年4月9日</div>\r\n<div>\r\n	<img alt="" height="440" src="/uploads/allimg/130424/1-1304240R25DI.jpg" style="width: 303px; height: 228px" width="353" /><img alt="" height="200" src="/uploads/allimg/130424/1-1304240R354P8.JPG" style="width: 384px; height: 228px" width="533" /></div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5600, 104, '<p style="text-align: center">\r\n	&nbsp;</p>\r\n<p style="text-align: left">\r\n	<span style="color: #3399cc"><span style="font-size: 16px"><strong>欢迎来到处长信箱！&nbsp;&nbsp;&nbsp;<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></span></span><br />\r\n	<span style="font-size: 16px"><strong><span style="color: #3399cc">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 如对我处工作有任何意见和建议，请写邮件到</span><a href="mailto:zhao_wei@jlu.edu.cn"><span style="color: #3399cc">zhao_wei@jlu.edu.cn</span></a><span style="color: #3399cc">，我们将及时回复和处理。</span></strong></span><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<span style="color: #3399cc">&nbsp;</span></p>\r\n<p style="text-align: right">\r\n	<span style="color: #3399cc"><span style="font-size: 16px"><strong>吉林大学资产管理与后勤处</strong></span></span></p>\r\n<h2>\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</h2>\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5668, 139, '依据《劳动法》与学校签定劳动合同，结合工作实际情况，制定本办法。<br />\r\n一、临时工的工资实行按岗取酬、按劳分配的原则，按学校规定日工资为22元。工资按实际工作天数支付，工作时间按学校日程执行。<br />\r\n二、临时工在试用期内工资为月工资的８０％。经过岗前培训适用期为一个月。试用期满合格人员工资待遇按合同执行，不能胜任工作的双方合同自动废止。<br />\r\n三、因工作需要须加班时，且不能补休时，按工资标准支付加班费，因工作需要误餐时，酌情支付误餐费。<br />\r\n四、根据用工岗位的特点，负责岗前培训，临时工按照工作岗位要求完成所交给的工作任务。<br />\r\n五、临时工应按工作要求，按时完成规定的工作数量，达到规定的质量标准，对在工作中出现严重操作失误，或因个人原因给学校造成经济损失由本人承担责任。<br />\r\n六、临时工不享受学校福利待遇。<br />\r\n七、学校不负担临时工疾病医疗费及意外伤害责任，在学校没有文件前不给缴纳医疗保险、养老保险和住房公积金。<br />\r\n八、临时工的病（事）假按月累计计算，累计不足４小时按半天计算，累计超过４小时不足８小时按１天计算。请假满一天以上者（含一天）按日工资额扣发工资。<br />\r\n九、有下列情况之一的临时工，可予以辞退。<br />\r\n1、违反劳动纪律、规章制度，经教育不改，经常迟到、早退、无故旷工、不服从正常工作分配及调动的。<br />\r\n2、不服从或不完成领导安排工作任务，不能按岗位职责履行职责的。<br />\r\n3、影响学校形象和声誉，聚众闹事，打架斗殴，影响正常工作和秩序以及违反计划生育政策的。<br />\r\n4、连续旷工两天、一月内累计三天或一年内累计７天的。<br />\r\n5、请事（病）假超过１个月以上（因工负伤除外）。<br />\r\n十 、临时工本人在合同期内要求辞聘的，应提前一个月以书面形式向用人部门提出申请，经用人部门许可，并交清工作后方可离岗。<br />\r\n十一、本规定未尽事宜，或者本规定中有关内容与国家、学校有关规定相悖的，按有关规定执行。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
