INSERT INTO `dede_addonarticle` VALUES (5614, 106, '<div style="text-align: center">\r\n	<strong>吉林大学非经营性资产转经营性资产管理办法</strong></div>\r\n<div style="text-align: center">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;（试行）</div>\r\n<strong>第一条 </strong>为规范和加强学校非经营性资产转经营性资产的管理，维护学校国有资产的安全与完整，提高学校国有资产的使用效益，根据财政部《事业单位国有资产管理暂行办法》及《吉林大学固定资产管理办法》的有关规定，结合我校实际情况，制定本办法。<br />\r\n<strong>第二条 </strong>非经营性资产是指学校为完成事业计划和开展业务活动所占有、使用的资产。<br />\r\n经营性资产是指学校按照国家有关规定，用于从事生产、经营性活动的资产。<br />\r\n学校非经营性资产转为经营性资产是指学校在保证正常教学、科研及教职工和学生生活不受影响的前提下，按照国家有关政策规定，将部分资产转为经营性使用的一种经济行为。<br />\r\n<strong>第三条</strong>&nbsp; 学校非经营性资产转为经营性资产的主要方式有：<br />\r\n&nbsp;（一）经学校批准，学校及所属单位用非经营性资产作为初始投资，在工商行政管理部门领取《企业法人营业执照》兴办具有法人资格的经济实体。<br />\r\n&nbsp;（二）经学校批准，学校及所属单位用非经营性资产作为注册资金，在工商管理部门领取营业执照，兴办不具有法人资格的附属营业单位。<br />\r\n（三）经学校批准，学校及所属单位用非经营性资产对外投资、入股、合资、联营等。<br />\r\n（四）学校认可的其它方式。<br />\r\n<strong>第四条</strong>&nbsp; 资产管理与后勤处是学校非经营性资产转为经营性资产管理的职能部门，其主要职责是：<br />\r\n（一）负责受理、组织、论证学校非经营性资产转为经营性资产的申报、审批；<br />\r\n（二）按有关规定对学校经营性资产进行评估、价值核定，并以此作为学校对该部门占有、使用国有资产考核的基础；<br />\r\n（三）建立学校经营性资产管理档案和资产账目；<br />\r\n（四）会同学校财务部门制定学校经营性资产效益考核指标体系及资产收益分配办法.#p#副标题#e#<br />\r\n<strong>第五条</strong>&nbsp; 学校所属单位将非经营性资产转为经营性资产，须向学校资产管理与后勤处提出申请报告，同时提交下列材料：<br />\r\n（一）可行性论证报告；<br />\r\n（二）拟开办的经济实体章程；<br />\r\n（三）投资、入股、合资、合作、联营等项目的意向书、草拟的协议或合同；<br />\r\n（四）拟投入资产的清单；<br />\r\n（五）按资产管理与后勤处要求需提交的其它文件、证件及材料等。<br />\r\n<strong>第六条</strong>&nbsp; 非经营性资产转为经营性的资产，作为学校投入的资本金，必须保证资产的安全与完整和保值增值<br />\r\n一、非经营性资产转为经营性资产后，资产性质仍为国家所有，资产占有和使用者不得擅自改变其国有性质。<br />\r\n二、用非经营性资产对外投资、入股、合资、联营的，学校按有关规定收取投资收益。<br />\r\n三、经营单位对占有和使用的学校经营性资产具有依法进行经营的权利，同时负有实现资产保值增值的义务。<br />\r\n四、对于造成学校经营性资产严重流失的经营单位，学校有权追究责任，并视情节轻重对其主要责任人进行行政处分和经济处罚。<br />\r\n<strong>第七条</strong>&nbsp; 本办法自发布之日起施行。原《吉林大学非经营性资产转为经营性资产的管理办法》(校字[2001]65号)同时废止。<br />\r\n&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5615, 106, '<strong>第一条</strong> 为规范和加强学校公用房屋出租出借管理，保证学校公用房屋安全使用，保护学校利益，根据《吉林大学固定资产管理办法》和《吉林大学校园经商秩序管理规定(暂行)》的有关规定，制定本规定。<br />\r\n<strong>第二条</strong> 本规定所指公用房屋是指在学校土地上建设的非住宅性质的所有房屋(包括场地和设施)。<br />\r\n<strong>第三条</strong> 凡不具有经营职能的校内单位均不得出租出借公用房屋。<br />\r\n<strong>第四条</strong> 具有经营职能的单位出租出借公用房屋必须符合下列要求：<br />\r\n(一) 符合学校制定的整体规划布局；<br />\r\n(二) 有利于为教学、科研和师生生活服务；<br />\r\n(三) 不影响校园环境和学校精神文明建设，不影响校园治安和消防安全。<br />\r\n<strong>第五条</strong> 公用房屋出租出借的审批应遵循如下程序：<br />\r\n(一) 公用房屋出租出借单位按要求填写《公用房屋出租出借申请表》，经办人、公用房屋出租出借单位的负责人和公用房屋管理单位负责人签字盖章；<br />\r\n(二) 将《公用房屋出租出借申请表》报资产管理与后勤处审核；<br />\r\n(三) 资产管理与后勤处上报有关领导审批。<br />\r\n<strong>第六条</strong> 获得批准出租出借公用房屋的校内各单位必须自觉履行以下职责<br />\r\n(一) 在获得批准之日起一周内将与承租方签定的租赁合同及相关附件的原件(一份)报资产管理与后勤处登记备案；<br />\r\n(二) 不得擅自改变公用房屋的结构，负责对公用房屋进行维修管理，保障公用房屋完好无损<br />\r\n(三) 按时按规定交纳工商、税务、土地等管理部门征收的各项费用；<br />\r\n(四) 按学校有关规定向学校交纳房屋出租出借所得收入。<br />\r\n<strong>第七条</strong> 以学校行为出租出借公用房屋由资产管理与后勤处统一办理手续，所得收入全部上交学校财务处。<br />\r\n<strong>第八条</strong> 校内任何单位和个人未经审批擅自出租处借公用房屋，学校有关部门将收回房屋并没收全部出租出借收入，同时追究有关人员责任，给予相应的行政处分和经济处罚。<br />\r\n<strong>第九条</strong> 本规定自发布之日起施行。<br />\r\n<strong>第十条</strong> 本规定由资产管理与后勤处负责解释。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5616, 106, '为了加强对学校固定资产处置的管理，根据国家有关规定和《吉林大学固定资产管理办法》，制定本规定。<br />\r\n&nbsp;一、学校固定资产处置，是指学校对其占有、使用的固定资产进行产权转让及注销产权的一种管理行为。包括出售、出让、转让、报废、毁损、盘亏、对外捐赠、投资、抵债等。<br />\r\n二、学校固定资产处置的原则<br />\r\n(一) 固定资产处置必须严格履行各项审批手续，由资产管理与后勤处负责组织实施，任何单位和个人未经批准不得自行处置。<br />\r\n(二) 单位价值较大，技术含量较高的固定资产处置必须组织相关专家论证。<br />\r\n(三) 数量较多或价值较高的固定资产处置首先要进行评估，确定残值后，再通过招标或议标的方式处置。<br />\r\n三、学校固定资产处置的申报<br />\r\n校内各单位拟处置固定资产必须首先提出申请，按要求填写相应的处置申报表并准备相关材料，报学校资产管理与后勤处。<br />\r\n四、学校固定资产处置的审批<br />\r\n资产管理与后勤处按照学校固定资产处置的原则对校内各单位填写的固定资产处置申报表进行审核，10万元以上报主管校长审批，100万元以上报教育部审批，并按有关规定进行报批或备案。<br />\r\n五、学校固定资产处置的账务处理<br />\r\n固定资产处置完毕后，学校固定资产管理部门和财务部门要依据固定资产处置凭证，调整学校的固定资产相关账目。<br />\r\n六、对违反上述规定擅自处置学校固定资产的单位和个人，资产管理部门将上报学校，依法给予相应的行政处罚和经济处罚。构成犯罪的，要依法追究刑事责任。<br />\r\n七、本规定自发布之日起实行。2001年4月12日印发的《吉林大学固定资产处置办法》(校字[2001]65号)同时废止。<br />\r\n八、本规定由资产管理与后勤处负责解释。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5618, 132, '<p>\r\n	详细内容见附件。</p>\r\n<br />\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130423/1-130423091412.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130423/1-130423091412.doc" target="_blank"><u>吉林大学固定资产账目管理条例</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5619, 133, '第一条&nbsp; 为了保障学校机动车辆的安全行驶，降低意外损害给学校带来的损失，根据《中华人民共和国道路交通安全法》、《机动车交通事故责任强制保险条例》等国家有关规定，结合学校实际情况制定本规定。<br />\r\n第二条&nbsp; 学校在用所有机动车辆均可参照本规定执行。<br />\r\n第三条&nbsp; 经资产与实验室管理处审核、界定，学校批准纳入学校统一管理的教学实验、行政公务用车，由学校统一预算办理车辆保险。结合我校车辆运行预算经费具体规定如下：<br />\r\n1、车辆原值在30万元以上且使用年限在10年以内保险险种为：交通事故责任强制险、车辆损失险、第三者责任险、车上人员责任险。<br />\r\n2、车辆原值在30万元以下保险险种为：交通事故责任强制险、第三者责任险、车上人员责任险。<br />\r\n第四条&nbsp; 凡纳入资产管理与后勤处统一经费管理的机动车辆每年由资产管理与后勤处会同有关部门面向社会公开招标，以保费和赔偿相对比确定保险公司。<br />\r\n第五条&nbsp; 未纳入资产管理与后勤处统一经费管理的机动车辆由授权管理使用、经营的部门结合本单位及机动车辆实际情况制定机动车辆年度保险办法申报，自行缴纳保险有关费用。<br />\r\n第六条&nbsp; 学校机动车辆发生道路交通事故时，当事人必须在24小时内（不可抗力因素除外）向当地交通管理部门或公安部门报案，同时向保险公司（保险人）和资产管理与后勤处报告。<br />\r\n第七条 &nbsp;因机动车辆驾驶人违法国家有关规定发生交通事故，保险公司（保险人）不予理赔所造成的经济损失由事故责任人自行承担。<br />\r\n第八条 &nbsp;本规定由资产管理与后勤处负责解释。<br />\r\n第九条 &nbsp;本规定自颁布之日起开始执行。<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5620, 133, '第一条&nbsp; 为加强机动车辆报废管理，淘汰老旧车辆，保障我校教学、行政办公用车行车安全，根据国家有关规定，制定本规定。<br />\r\n第二条&nbsp; 本规定适用于车籍归吉林大学管理的机动车辆。<br />\r\n第三条&nbsp; 资产管理与后勤处主管全校机动车辆报废工作。各用车单位应协助资产管理与后勤处做好机动车辆报废的相关工作。<br />\r\n第四条&nbsp; 机动车辆达到国家规定的报废标准的，应予报废。<br />\r\n第五条&nbsp; 机动车辆报废，各用车单位应向资产管理与后勤处提出申请，拟报废机动车辆由资产管理与后勤处进行认定。车辆的发动机、变速器、车架、方向机、前后桥、车身等六大主要部件（简称六大总成）必须齐全。<br />\r\n第六条&nbsp; 资产管理与后勤处接到申请后，依据车辆档案对车辆整车（含六大总成）及使用年限、行驶里程等进行认定，符合报废条件的，批准报废，发给《吉林大学仪器设备报废单》。<br />\r\n第七条&nbsp; 报废车辆单位持《吉林大学仪器设备报废单》去相应部门办理销帐手续。<br />\r\n第八条&nbsp; 拟报废车辆由用车单位指定地点存放，专人负责办理报废车辆的交接手续。报废车辆由国家批准的报废汽车回收（拆解）企业回收处理，并协助我校办理销籍手续。<br />\r\n第九条&nbsp; 机动车辆确因工作需要申请延期报废的，其条件、审批程序和检验，按国家和省、市人民政府的相应规定办理。<br />\r\n第十条&nbsp; 我校拟报废车辆应严格执行国家颁布的《汽车报废标准》，各用车单位不得对拟报废的机动车辆私自拆解、出售各部门及其工作人员，应认真履行职责，违反本规定由其所在单位或上级主管部门给予行政处分；构成犯罪的，由司法机关依法追究刑事责任。<br />\r\n第十一条&nbsp; 本规定自发布之日起施行。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5621, 133, '详情见附件<br />\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130423/1-130423093521.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130423/1-130423093521.doc" target="_blank"><u>吉林大学机动车辆管理办法</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5622, 132, '第一条 为规范和加强学校家具管理，合理配置家具，充分发挥使用效益，更好的为教学、科研和各项事业发展服务，根据《吉林大学固定资产管理办法》的有关规定，制定本规定。<br />\r\n第二条 本规定适用学校教学、科研、实验、行政办公、后勤、产业、学生宿舍等校内各单位使用的各类家具的管理。<br />\r\n第三条 资产管理与后勤处负责学校家具的产权产籍管理，其主要职责是：<br />\r\n（一）负责学校家具配置标准的制定、审核及监督；<br />\r\n（二）负责学校购置家具的计划审核、验收工作；<br />\r\n（三）负责学校家具调剂、调拨、处置等的管理工作；<br />\r\n（四）负责学校家具账目的管理及数据统计工作；<br />\r\n（五）负责学校返库家具的维修工作。<br />\r\n第四条 学校相关职能部门和使用单位负责学校家具的日常使用管理。<br />\r\n第五条 校内单位购置家具执行下列程序：<br />\r\n（一）提出购置家具申请和计划，落实经费预算；<br />\r\n（二）经资产管理与后勤处核定配置标准和购置计划；<br />\r\n（三）报采购管理中心统一采购。<br />\r\n第六条 学校新购置或接受捐赠等新增的家具，应当由资产管理与后勤处进行实物验收。验收合格后，依据发票等凭证填写《吉林大学家具验收凭单》，办理固定资产入账手续，到财务处报销。<br />\r\n第七条 校内各单位对长期闲置不用和报废、报损的家具，应当报资产管理与后勤处统一回收调剂和处置，不得擅自处理。<br />\r\n第八条 本规定自发布之日起施行。<br />\r\n第九条 本规定由资产管理与后勤处负责解释。<br />\r\n<br />\r\n附件：\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<strong><a href="/uploads/soft/130423/家具配备标准.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></strong></td>\r\n			<td>\r\n				<strong><a href="/uploads/soft/130423/家具配备标准.doc" target="_blank"><u>吉林大学家具配备标准</u></a></strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5623, 132, '为规范家具(被服装具)验收工作，保证购置家具(被服装具)质量合格，符合需求，维护学校固定资产的安全与完整，根据《吉林大学固定资产管理办法》《吉林大学家具管理规定》，制定本实施细则：<br />\r\n一、验收条件<br />\r\n学校各单位购置的家具(被服装具)在规定期限内送到指定地点并安装完毕后，由使用单位向资产管理与后勤处提出验收申请并提供相关购销合同和发票。特殊材质和特殊性能的家具需要提供权威部门出具的相关鉴定报告。<br />\r\n二、验收依据<br />\r\n验收部门依据购销合同及发票进行验收，招标项目还要依据中标样品进行验收。<br />\r\n三、验收时限<br />\r\n验收部门在接到验收申请单及全部相关资料后，按照验收流程进行验收。对于合同金额万元以上的应及时进行验收；合同金额十万元以上的应在十五日内完成验收工作。<br />\r\n四、验收方式<br />\r\n(一)家具(被服装具)一律实行现场实物验收；<br />\r\n(二)严格按照购销合同中关于家具(被服装具)的种类、数量、规格、样式、材质、颜色等要求逐一核对，招标项目还要对照中标样品进行验收；<br />\r\n(三)家具(被服装具)购置金额万元以上，由资产管理与后勤处会同使用单位进行验收；<br />\r\n(四)家具(被服装具)购置金额十万元以上的，由资产管理与后勤处组织会同采购中心和使用单位进行验收。<br />\r\n五、验收标准<br />\r\n(一) 严格执行国家关于家具(被服装具)质量标准的相关规定，达到环保要求；<br />\r\n(二) 严格执行《吉林大学家具管理规定》中关于家具配置标准的各项具体要求；<br />\r\n(三)所购置的家具(被服装具)不超过已审批的配置计划；<br />\r\n(四)所购置的必家具(被服装具)须符合合同中的各项约定；<br />\r\n(五)所购置的家具(被服装具)达到其它需要满足的指标要求。<br />\r\n六、验收中存在问题的处理<br />\r\n(一)未达到验收标准的家具(被服装具)一律不予通过验收；<br />\r\n(二)对验收过程中有关各种标准的解释存在争议的，由双方共同认定的权威部门进行裁决；<br />\r\n七、验收入账<br />\r\n家具(被服装具)验收合格后,由验收组成员填写《吉林大学家具验收凭单》或《吉林大学被服装具验收凭单》，办理固定资产入账手续。购置金额万元以上的家具(被服装具)同时需要填写《吉林大学家具(被服装具)验收报告》，验收人员和负责人签字后资产管理与后勤处存档备查。<br />\r\n八、本验收实施细则自发布之日起施行。<br />\r\n九、本验收实施细则由资产管理与后勤处负责解释。<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5624, 138, '为规范和加强学校土地管理，合理利用学校现有土地资源，保证学校整体规划，建设优美的校园，完善教学环境。根据《中华人民共和国土地管理实施条例》的有关规定，制定本办法。<br />\r\n&nbsp;<strong>第一条</strong>&nbsp; 本办法所称的土地是指学校依法以地方政府无偿划拨、有偿转让或其他方式获得使用权的土地。<br />\r\n&nbsp;<strong>第二条</strong>&nbsp; 资产管理与后勤处是学校土地管理的职能部门，其主要职责是：<br />\r\n（一）贯彻落实国家及各级地方政府有关土地管理的政策法规，监督校内单位对学校土地的依法使用；<br />\r\n（二）参与制定学校土地利用总体规划和年度土地利用计划；<br />\r\n（三）负责学校土地的产权产籍的管理工作。主要包括土地使用权证的保管及年度审验工作；土地转让手续的办理工作；协助校内有关部门办理新建、换建等土地利用和新征土地产权手续；<br />\r\n（四）负责包括土地权属、土地利用现状、土地条件等在内的土地调查及勘界工作；<br />\r\n（五）负责学校土地登记、账目管理和相关数据统计、报表等工作；<br />\r\n（六）负责对利用学校土地从事经营活动的审批工作；<br />\r\n（七）其他学校土地的管理工作。<br />\r\n<strong>第三条</strong>&nbsp; 学校新征土地由征地单位负责办理征用土地的各种手续及土地使用权证，按规定要求到资产管理与后勤处登记入账并备案。<br />\r\n<strong>第四条</strong>&nbsp; 学校新建、扩建、改建等项目的土地使用手续(包括办理各种土地使用权证)由学校建设单位负责办理，按规定要求到资产管理与后勤处登记入账并备案。<br />\r\n<strong>第五条</strong>&nbsp; 校内各单位在学校土地范围内从事经营活动的,必须经学校资产管理与后勤处审批，未经批准，任何单位不得利用学校土地从事经营活动。<br />\r\n<strong>第六条</strong>&nbsp; 校内的经营单位必须依法自行办理改变土地使用功能的各种手续，依法向政府土地管理部门交纳土地收益金等相关费用并自行承担相关行政责任和经济责任。<br />\r\n<strong>第七条</strong>&nbsp; 本办法自发布之日起实行。<br />\r\n&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5625, 135, '<div style="text-align: center">\r\n	<strong>资产管理与后勤处计算机网络系统使用及安全管理须知</strong></div>\r\n<br />\r\n依据《中华人民共和国计算机信息网络国际联网管理暂行规定》,为了高效、科学的使用资产管理与后勤处计算机网络系统，规范网络系统的管理，保证网络系统的安全运行，特制定如下须知：<br />\r\n<strong>一、计算机网络系统管理 </strong>。<br />\r\n1、资产管理与后勤处设定系统管理员岗位，其主要职责为:<br />\r\n①负责管理服务器等网络系统关键设备的日常使用和维护，及时排除计算机故障；<br />\r\n②负责系统软件安装、调试、授权使用权限、数据恢复；<br />\r\n③负责计算机房管理；<br />\r\n④负责完整保存服务器等设备的驱动程序、保修卡及重要随机文件。<br />\r\n２、系统数据由资产管理与后勤处指定专人管理。终端操作人员必须经过操作培训和安全教育后方可上岗操作。<br />\r\n3、计算机终端操作人员如发现计算机系统运行异常，应及时与系统管理员联系，不得擅自拆卸计算机或更换计算机器件。<br />\r\n4、服务器、终端计算机实行专管专用，非系统操作人员不得使用，系统操作人员严禁上网或浏览任何与工作无关信息。<br />\r\n5、严禁利用计算机非法入侵他人或其他组织的计算机信息系统。<br />\r\n<strong>二、计算机机房管理制度</strong><br />\r\n1、服务器、双机热备、硬件防火墙、不间断电源等是网络系统的关键设备，不得随意配置或更换，更不能挪作他用。<br />\r\n2、保持计算机房清洁、保证机房的安全。<br />\r\n3、严禁将易燃易爆和强磁物品及其它工作无关的物品带入机房。4、建立机房登记制度，无关人员未机经批准严禁进入机房。<br />\r\n5、建立网络管理运行状况档案，对所发生的故障、处理过程和<br />\r\n结果等做好详细记录。#p#副标题#e#<br />\r\n&nbsp;<strong>三、软件及应用程序管理 </strong><br />\r\n任何人不得安装与工作无关的软件，软件及应用程序的配置、安装需由系统管理员根据工作需要确认，任何人不得私自安装盗版软件。否则，责任人将受到处罚。<br />\r\n<strong>四、计算机病毒的防范</strong><br />\r\n１、采用国家许可的正版防毒软件并及时升级软件版本<br />\r\n２、系统操作人员必须要有病毒防范意识，计算机服务器和终端计算机必须安装杀毒和防火墙软件方可使用，每天进行一次计算机病毒检测，发现病毒立即按规定处理。<br />\r\n３、系统操作人员对经远程通信传送的程序或数据(如：电子邮件)，必须经过检测确认无病毒后方可使用。<br />\r\n<strong>五、数据保密</strong><br />\r\n1、根据数据的使用范围和数据的保密规定，确定数据使用人员的浏览及存取等权限。<br />\r\n2、禁止泄露、外借和转移数据信息。<br />\r\n3、系统数据必须严格保密、保证安全，防止因人为原因造成的系统数据的非法生成、变更、泄露、丢失及破坏。<br />\r\n4、系统操作人员必须对登录计算机管理系统的密码保密，不得转告他人。<br />\r\n&nbsp;<strong>六、数据备份</strong><br />\r\n1、系统管理员、终端操作人员必须每天对计算机系统的业务数据进行数据的备份。<br />\r\n2、备份数据不得更改。<br />\r\n3、备份的数据必须指定专人负责保管，所备份的数据（光盘、磁带）未经批准，不得转交他人保管。<br />\r\n4、系统数据必须定期（每天）、完整、真实、准确地转储到不可更改的介质(如光盘)上，并要集中保存。<br />\r\n5、备份数据资料保管地点应有防火、防热、防潮、防尘、防磁、防盗设施。<br />\r\n<strong>七、处罚</strong><br />\r\n未按本须知要求进行操作，造成工作损失和网络系统设备损坏，其责任人将受到行政处分和经济处罚。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5626, 102, '&nbsp;<br />\r\n一、参与学校有关资产管理与后勤发展规划、年度计划等重大问题的讨论、研究和决策。<br />\r\n&nbsp;<br />\r\n二、贯彻落实国家及地方国有资产管理、土地资源开发及住房改革政策与规定，结合学校各类资产管理的实际和特点，制定相应的规章制度和实施细则，并负责组织实施、监督检查。<br />\r\n&nbsp;<br />\r\n三、负责学校资产管理工作，监督学校经营性资产的运营状况，确保国有资产保值、增值，严防国有资产流失。<br />\r\n&nbsp;<br />\r\n四、负责制定学校资产管理规划，统一科学配置、调整、管理学校教学、科研、行政、学生、生活土地、房屋等资源。<br />\r\n&nbsp;<br />\r\n五、负责学校土地、房屋产权登记、备案管理；负责学校土地、房屋和其他教学、科研、行政、学生、生活设施的数据统计与建档工作。<br />\r\n&nbsp;<br />\r\n六、负责学校投入校办产业资产的产权管理，保值增值目标的核实和考核，不良资产和坏账处置的审核；通过学校国有资产管理委员会行使对资产经营公司（吉大控股）及其他投资类资产进行监管。<br />\r\n&nbsp;<br />\r\n七、负责制定并执行学校后勤服务和保障的工作规划，编制及执行后勤经费预算。<br />\r\n&nbsp;<br />\r\n八、负责学校房屋和基础设施的大型维修与改造的计划编制、工程立项、经费预算和任务下达并监督实施。<br />\r\n&nbsp;<br />\r\n九、负责节约型校园建设的规划与实施工作，依法加强对学校能源的管理，建立科学合理的能源使用管理、审查、评估、监督及回收体系。<br />\r\n&nbsp;<br />\r\n十、负责学校职工住房、周转房的管理与服务工作；负责组织实施学校职工住房制度改革、住房补贴、供暖费补贴等管理工作。<br />\r\n&nbsp;<br />\r\n十一、负责学校校园及家属区绿化、美化、净化的管理工作。<br />\r\n&nbsp;<br />\r\n十二、负责学校爱卫会的日常工作。<br />\r\n&nbsp;<br />\r\n十三、代表学校以契约方式与校内后勤各服务实体签订各类服务、经营文书；并对承担学校后勤服务的校内后勤服务经营实体和社会专业公司的服务质量进行监督、考核和评估。<br />\r\n&nbsp;<br />\r\n十四、调查、研究土地及房地产市场行情，做好开发项目论证工作；并根据学校决定，发布学校土地及相关不动产资源拟开发利用信息，收集各类反馈信息，开展商业洽谈，并做好开发项目的实施与管理工作。<br />\r\n&nbsp;<br />\r\n十五、负责与工作范围内的上级主管部门和地方政府相关部门之间的协调，保持联络渠道畅通。<br />\r\n&nbsp;<br />\r\n十六、负责吉林大学国有资产管理委员会日常事务工作。<br />\r\n&nbsp;<br />\r\n十七、完成学校交办的其他工作。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '59.72.106.181');
INSERT INTO `dede_addonarticle` VALUES (5763, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 16px">&nbsp;<big><span style="font-size: 22px"> 2014年04月17日下午，中国海洋大学党委副书记兼副校长陈锐、后勤服务集团总经理王哲强来我校调研后勤管理体制、机制等方面工作。总会计师杜莉及资产管理与后勤处、后勤服务集团、后勤资产经营公司、人力资源与社会保障处负责人参加了座谈会。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 座谈会在商贸楼会议室举行，首先杜莉总会计师对陈校长一行表示欢迎，并对我校基本情况做了简要介绍；随后资产管理与后勤处处长赵伟就我校后勤管理的现行模式、后勤管理体制改革以及改革取得的进展进行了讲解；会上双方还就后勤人才队伍建设、后勤服务文化建设等问题进行了深入的交流，也对后勤管理体制、机制改革中存在问题作了详细的探讨。中国海洋大学对我校后勤工作取得的成绩表示赞许；同时双方也就高校后勤管理方面的问题交流了意见和建议，会议在融洽的气氛中结束。</span></big></span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5704, 102, '1、负责拟定学校机动车辆运行经费计划。<br />\r\n2、负责办理机动车辆购进批件、车辆落籍、转籍、过户灭籍、审验等手续。<br />\r\n3、负责机动车辆保险、缴纳各种税费的管理。<br />\r\n4、协调车辆使用单位代表学校处理机动车辆交通事故和办理保险理赔。<br />\r\n5、负责鉴定、检验到期报废车辆，回收报废车辆和车籍、牌照、行车证等，办理灭籍工作。<br />\r\n6、负责组织全校车辆的年度检验和办理车船使用税、专职驾驶员的驾驶证的年审、记分卡更换工作。<br />\r\n7、组织落实交通管理部门开展的各种交通安全活动。<br />\r\n8、完成处领导交办的其他工作。<br />\r\n<br />\r\n<br />\r\n科室成员<br />\r\n科长：廖吉江&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公地点：前卫南区商贸楼401-1室 电话：85151028<br />\r\n', '', '', '59.72.106.181');
INSERT INTO `dede_addonarticle` VALUES (5761, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style="font-size: 16px">&nbsp; 根据处党支部工作安排，2014年3月21日下午，资产管理与后勤处在匡亚明楼会议室召开支部工作会议，全体党员参加，会议由高殿国副处长主持。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 会议主要任务是进行支部委员改选工作，由于学校人事变动调整，原支部书记李宏伟同志调至学校其他部门工作，经过原支部委员酝酿推荐、征求意见、及会上全体党员举手表决，通过选举赵伟处长为资产管理与后勤处党支部新任支部书记，董宏志副处长为副书记，温凤义同志、解丹同志、王泽一同志为支部委员。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 之后，新任支部书记赵伟处长对原支部委员表示了感谢，并就保持党员先进性、增强凝聚力、拓宽沟通群众渠道、完善学习型组织建设及进一步加强反腐倡廉工作等方面提出了新的要求及部署。</span><br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5705, 102, '<span style="font-size: 14px">一、贯彻落实国家及各级地方政府有关土地管理的政策法规，监督校内单位对学校土地的依法使用；参与制定学校土地利用总体规划和年度土地利用计划。<br />\r\n二、负责学校土地权籍的管理工作。主要包括土地产权界定和使用权证的管理，土地转让和新增土地的产权办理，学校权属土地的利用现状、边界勘查及土地纠纷的处理等工作。<br />\r\n三、负责学校土地使用权证的年度审验、变更登记和土地账目管理、信息建设、统计报表等日常管理工作。&nbsp;&nbsp;&nbsp;<br />\r\n四、根据学校土地开发（置换）的决定，负责收集、整理开发（置换）地域的相关数据、可行性资料等工作信息，并负责拟定工作方案、组织业务谈判和协议签订、办理上级报批和地方行政审批的工作。<br />\r\n五、完成处领导交办的其他工作。</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '59.72.106.140');
