INSERT INTO `dede_addonarticle` VALUES (5627, 120, '邮寄联系地址：北京市东城区安定门东大街28 号雍和大厦西楼三层301（邮编：100007）<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;现场办理地址：雍和大厦西楼一层国际版权交易中心版权登记大厅<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;咨询电话：010&mdash;68003934<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;查询电话：010&mdash;68003220<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;邮寄材料查询电话：010&mdash;68003516<br />\r\n&nbsp;软件登记申请费和查询费用通过银行汇款的，请务必将费用汇入以下专用帐号：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;开户银行：中信银行北京阜成门支行（银行行号711201）<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;帐户名称：中国版权保护中心 &nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;银行帐户：7112010189800001174&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;收款室传真：010-68003395<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5628, 118, '详情见附件\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130423/吉林大学房屋及建筑物资产验收程序.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130423/吉林大学房屋及建筑物资产验收程序.doc" target="_blank"><u>吉林大学房屋及建筑物资产验收程序</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5629, 119, '为规范吉林大学教学行政车辆的维修经费管理，根据校财务年度预算经费定额，结合我校教学科研行政用车实际情况，车辆维修经费由国有管理处定额分配、使用管理。维修车辆超定额部分由车辆使用部门自行承担。<br />\r\n一、机动车辆维修程序<br />\r\n机动车辆使用单位要加强管理，做好定期检查和修理记录，及时维修确保机动车辆的完好率。机动车辆维修按以下程序办理：<br />\r\n1、车辆使用单位对年度维修机动车辆提出申请报资产管理与后勤处审核。<br />\r\n2、 机动车辆使用部门填写《吉林大学机动车辆维修（保养）项目报批单》，由车辆使用单位负责人签字并加盖公章。<br />\r\n3、 经核实后持《吉林大学机动车辆维修（保养）项目报批单》到指定修配厂按照故障原因拟检修项目对机动车辆进行维修、保养。汽车维修必须在定点企业有市二级以上维修资质的修配厂家，具体维修厂家资质由资产管理与后勤处审核征求各用车单位意见后确定。<br />\r\n4、 车辆修理结束后，驾驶员有义务对维修的车辆进行严格验收，确认故障排除后，在《车辆维修明细单》上签字认可。<br />\r\n5、 资产管理与后勤处凭《吉林大学机动车辆维修（保养）项目报批单》与《车辆维修明细单》及机动车辆维修统一发票核对，使用单位按照吉林大学财务处报销程序认真填写《吉林大学报销单》，经资产管理与后勤处相关负责人签字后至财务处进行机动车辆维修结算。<br />\r\n二、车辆维修注意事项<br />\r\n1、 各单位使用车辆必须指派专职驾驶员，驾驶员要经常将车辆进行维护和保养，使车辆保持良好的工作状况。<br />\r\n2、交通肇事车辆必须由交通部门和保险公司确认责任后，方可维修。维修参照机动车辆维修程序执行。<br />\r\n3、 非专职驾驶员严禁驾驶学校教学行政车辆，违反者造成车辆损坏由当事人承担全部责任及由此产生的各种费用。<br />\r\n4、机动车辆管理部门和使用单位对指定的修配厂严格检查、监督，把住质量关，其所采用的维修零部件、配件等材料必须符合国家或部颁标准。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5759, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 16px">&nbsp;&nbsp; 2013年12月18日上午，由国家机关事务管理局公共机构节能司处长刘承茂、中国建筑科学研究院专家柳松、吉林省机关事务管理局节能处副处长组成的验收组来我校对节约型公共机构示范建设进行验收。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 会议由刘承茂处长主持，刘处长代表国家机关事务管理局及验收组，对此次验收的目的和验收的要求进行了说明。学校资产管理与后勤处处长赵伟代表吉林大学及杜总会计师对国家验收组到来表示热烈的欢迎并向验收组介绍了我校创建节约型公共机构示范建设所做各项主要工作和学校后勤改革情况。学校节能办公室主任胡志春按照验收要求，汇报了我校创建节约型公共机构所做的工作，汇报采用文字、图片和统计图表的方式，内容详实。汇报结束后应国家验收组要求，节能办公室向验收组进行了吉林大学能源监管平台功能演示。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 柳承茂处长在验收总结时指出，吉林大学是教育部在东北地区唯一推荐的节约型公用机构院校，吉林大学在节约能耗方面取得了较好经济效益和社会效益，学校在节能方面的宣传广泛到位、在节约型公共机构建设上取得的成绩显著，并希望吉林大学继续做好节约型公共机构示范建设工作，国管局和省管局全力支持吉林大学节约型公共机构示范建设，并预祝吉林大学在此次的验收评测中取得好成绩。</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5760, 109, '<span style="font-size: 16px">&nbsp; 按照学校党的群众路线教育实践活动的总体安排，12月23日下午资产管理与后勤处党支部召开了专题组织生活会，支部全体党员参加了本次会议，会议由资产管理与后勤处处长赵伟主持。<br />\r\n<br />\r\n&nbsp;会上，学习了习近平总书记河北主要讲话精神，学习了厉行节约反对浪费条例，并就我处党的群众路线教育实践活动开展情况向全体党员做了说明。要求全体党员按照&ldquo;照镜子、正衣冠、洗洗澡、治治病&rdquo;的总要求，以反对&ldquo;四风&rdquo;问题开展批评与自我批评&rdquo;主题，针对自身工作以及自身存在的缺点和问题进行深刻剖析。<br />\r\n<br />\r\n&nbsp; 随后，全体党员分别就个人遵守党的政治纪律情况、贯彻落实党中央八项规定精神、转变作风方面的基本情况、&ldquo;四风&rdquo;方面存在的突出问题、今后努力的方向和改进措施等方面依次做了深入的对照检查和自我剖析同时开展了互相批评。大家坦诚相待、真心实意、相互揭短达到了&ldquo;团结&mdash;批评&mdash;团结&rdquo;的目的。&nbsp;<br />\r\n<br />\r\n&nbsp; 最后，第一责任人赵伟发表总结讲话。他要求全体党员加强&ldquo;学习&rdquo;，把学习当成一种需求、一种快乐、一种习惯和一种境界，在不断学习的基础上提升个人的业务水平和综合素质；要促进&ldquo;和谐&rdquo;，相互合作，相互支持，共谋事业的发展之道，凝心聚力，继往开来；做事要&ldquo;精致&rdquo;，要以&ldquo;精心、精细、精致&rdquo;为工作理念，努力使资产后勤工作上台阶、上水平；要有&ldquo;敬畏&rdquo;意识，要敬畏岗位，要敬畏承担的责任、敬畏法律、敬畏人格，恪尽职守，履职尽责。全体党员要以本次专题组织生活会为契机，坚持用好批评与自我批评的武器，提高解决自身问题的能力，团结融合、凝心聚力、共谋发展。</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
