INSERT INTO `dede_addonarticle` VALUES (5754, 116, '详情见附件<br />\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/131221/1-1312211R233.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/131221/1-1312211R233.doc" target="_blank"><u>校园管理科项目流程</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5633, 126, '处长办公会<br />\r\n主持人：处长<br />\r\n时&nbsp; 间：每周一上午8：30<br />\r\n参加人：副处长及指定参加的相关人员<br />\r\n内&nbsp; 容：1、 研究制定本处各类决策、工作方案、制度等重大事宜。<br />\r\n2、制定年、月工作计划。<br />\r\n3、总结上周工作和研究、讨论、布置下周工作。<br />\r\n记&nbsp; 录：处办主任<br />\r\n记录内容：议题、意见及形成的决议等会议内容<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5634, 139, '<strong>第一章</strong>&nbsp; <strong>总</strong>&nbsp;&nbsp; <strong>则</strong><br />\r\n第一条&nbsp; 实行预付费管理方式是加强供用电管理科学化、规范化、制度化的一种行之有效的手段，是提高管理水平、促进经费收支平衡，降低消耗的重要途径。为了加强学校电费查收管理，推广使用IC卡预付费电能表系统，根据吉林大学校发〖 2002〗31号《关于安装预付费电能表的通知》要求，结合学校的实际情况制定本办法。<br />\r\n第二条 本办法所指IC卡预付费电能表系统，是通过安装IC卡式电能表，对用户实行先交费购电，后用电消费的管理方式。<br />\r\n第三条 本办法所称管理部门是指资产管理与资产管理与后勤处节能办公室。<br />\r\n<strong>第二章 IC卡预付费电能表管理</strong><br />\r\n第四条 资产管理与资产管理与后勤处代表学校，负责学校IC卡预付费电能表系统的管理，并负责 IC卡预付费电能表的安装、维护、售电等日常管理工作。<br />\r\n&nbsp;第五条 各用户要设专人负责本单位的IC卡预付费电能表的管理，负责办理预购电，避免因不及时购电欠费而发生断电情况，用电单位应将购电负责人名单报管理部门备案。以方便工作联系。因用户不能及时预购电而发生断电由此产生的一切后果由用户负责。<br />\r\n&nbsp;第六条IC卡预付费电能表及附属设备出现故障，用户应及时与管理部门进行联系，尽快排除故障恢复供电。如因欠费断电，用户应及时购电以便恢复供电。<br />\r\n&nbsp;第七条&nbsp; IC卡预付费电能表实行一卡一表管理，互不通用，管理部门为各用户编制管理号码，把有关数据输入管理系统。<br />\r\n&nbsp;第八条&nbsp; IC卡预付费电能表购电卡（用户卡）由用户自己妥善保管在购电或查询余额时使用，如有丢失或损坏，用户到管理部门申请补卡，补卡费由用户承担。<br />\r\n&nbsp;第九条&nbsp; IC卡预付费电能表安装后，用户应按《IC卡预付费电能表使用须知》规定使用并注意维护供电系统，如因使用不当或其他原因造成 IC卡预付费电能表损坏，更换电能表费用由用户承担。<br />\r\n&nbsp;<strong>第三章</strong>&nbsp;<strong> IC</strong><strong>卡预付费电能表预售电管理</strong><br />\r\n&nbsp;第十条 学校管理部门根据本区域一次电能表的平均电价或按长春市行业电价的收费标准进行售电。<br />\r\n&nbsp;第十一条 管理部门要设专人负责预售电工作，用户应在规定的时间前去购电。即法定假日、每月周三下午、每月末最后一天不售电，学校寒暑假期间每周二上午售电，平日每天上午8时至11时，下午13时30分至15时30分售电，特殊情况不能正常售电时管理部门在校园网上另行通知。<br />\r\n&nbsp;第十二条 管理部门要按规定及时将收缴的电费上交学校财务处。<br />\r\n&nbsp;<strong>第四章</strong>&nbsp;&nbsp; <strong>违章处罚</strong><br />\r\n&nbsp;第十三条 禁止窃电行为，窃电行为包括私自开启IC卡预付费电能表箱铅封（锁）、在供电设施上擅自接用电、绕越电能表用电、伪造或者开启管理部门加封的用电计量铅封印用电、故意损坏电能表、故意使用电计量装置不准或者失效、采用其它方法窃电。<br />\r\n第十四条 对违反第十三条款的，管理部门根据实际情况、情节，给予500&mdash;10000元的罚款或停止供电。<br />\r\n<strong>第五章</strong>&nbsp; <strong>附</strong>&nbsp; <strong>则</strong><br />\r\n&nbsp;第十五条 本办法适用全校的IC卡预付费电能表用户。<br />\r\n&nbsp;第十六条 本办法由资产管理与资产管理与后勤处节能办公室负责解释。<br />\r\n&nbsp;第十七条 本办法自公布之日期起施行。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5635, 128, '<strong>第一章 总则</strong><br />\r\n&nbsp;&nbsp;&nbsp; 第一条、为了使大维修及校园建设工作管理制度化、规范化、合同化、实效化，本着以改造影响师生员工正常工作、学习、生活的基础设施和脏乱差环境为突破口，使大维修及校园建设工作有序地进行，特制定本办法。<br />\r\n&nbsp;&nbsp;&nbsp; 第二条、资产管理与资产管理与后勤处代表学校行使对学校大维修及校园建设工程（以下简称工程）的管理职权。其中包括工程的计划编制、设计、招标、施工过程的管理及控制、竣工验收和预决算审核等事宜。<br />\r\n&nbsp;&nbsp;&nbsp; <strong>第二章 大维修及校园建设工程的界定</strong><br />\r\n&nbsp;&nbsp;&nbsp; 第三条、凡单项工程直接费3000元以上的，即定为大维修及校园建设工程项目。<br />\r\n&nbsp;&nbsp;&nbsp; <strong>第三章 计划的编制</strong>：<br />\r\n&nbsp;&nbsp;&nbsp; 第四条、每年年初由资产管理与资产管理与后勤处根据学校当年财务状况，结合大维修和校园规划，制定本年度的工程计划，报主管校长审批后，方可实施。<br />\r\n&nbsp;&nbsp;&nbsp; 第五条、因突发事件、不可预见发生的计划外工程项目，如属正常工程项目，由资产管理与资产管理与后勤处派专业技术人员现场勘察，填写立项开工单，报主管处长、资产管理与资产管理与后勤处处长审批后方可施工。如属特殊的项目，需由主管校长审批。<br />\r\n&nbsp;&nbsp;&nbsp; <strong>第四章 施工队伍的确定 </strong><br />\r\n&nbsp;&nbsp;&nbsp; 第六条、单项工程造价在5万元以下的施工队伍确定，由资产管理与资产管理与后勤处指定施工单位施工。<br />\r\n&nbsp;&nbsp;&nbsp; 第七条、单项工程造价在5万元以上（含5万元），10万元以下（不含10万元）的施工队伍确定，由招标与采购管理中心采取议标形式确定。<br />\r\n&nbsp;&nbsp;&nbsp; 第八条、工程造价在10万元以上（含10万元）的施工队伍确定，由学校招标与采购管理中心组织招标确定。<br />\r\n<strong>第五章 合同的签订</strong><br />\r\n&nbsp;&nbsp;&nbsp; 第九条、由招标与采购管理中心负责签订。<br />\r\n&nbsp;&nbsp;&nbsp; 第十条、合同的变更，由招标与采购管理中心、资产管理与资产管理与后勤处共同汇签确认。<br />\r\n<strong>第六章 开工前程序 </strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十一条、凡属于突发工程和委托工程，需签署《工程立项书》及出具工程预算书方可进场施工。中标单位在签定合同后，视情况领取《开工报告单》，到相关部门（如资产管理与资产管理与后勤处校园管理科、节能办公室、保卫处等单位）办理相关手续，并且在施工现场明显位置设施工公告，方可开工。<br />\r\n<strong>第七章 施工现场监督程序 </strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十二条、工程造价在30万元以下的工程项目，由资产管理与资产管理与后勤处项目负责人和校区后勤办的工程管理人员负责施工现场的质量、进度等方面的监督工作，工程造价在30万元以上的工程项目，视情况由资产管理与资产管理与后勤处工程项目负责人、校区办工程人员及监理工程师共同负责全面质量监督工作（聘用监理公司的项目，参照国家有关监理规定执行），对违反国家有关建设规范的一切行为，有权停止施工单位的不合理工序和不合格材料的使用，并根据实际情况予以处理。<br />\r\n<strong>第八章 竣工验收程序</strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十三条、施工单位在单项工程竣工，自检合格后向校区后勤办提出竣工验收请示报告，资产管理与资产管理与后勤处组织有关部门和使用单位进行联合验收，填写《工程竣工验收交接保修单》，验收合格后，将工程交付使用方。<br />\r\n<strong>第九章 工程决算程序 </strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十四条、工程验收合格15日内，施工单位将该项工程的预算、合同、保修范围、验收单及工程决算汇总报校区后勤办初审，资产管理与资产管理与后勤处工程科复审后，报主管处长签批后，送审计处审核，经有关领导签字后生效。工程的取费标准应执行省市有关各项各类工程的取费标准，在工程定额中找不到的工程项目，可在相应的定额中套用，并给予注释。工程的结算按工程造价的5%&mdash;10%留质保金，保修期满后付清。<br />\r\n&nbsp;<strong>第十章 工程保修期的管理 </strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十五条、工程在保修期内，所发生的因工程质量引起的维修维护内容及连带产生的费用全由施工单位承担，如施工单位不履行，则由质保金中列支费用维修。<br />\r\n&nbsp;<strong>第十一章 工程档案管理程序 </strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十六条、单项工程结束后，《任务下达书》、《开工报告》、招标文件、投标书、合同、决算单等一并存档，备查。<br />\r\n<strong>第</strong><strong>十二</strong><strong>章 附 则</strong><br />\r\n&nbsp;&nbsp;&nbsp; 第十七条 本管理办法由资产管理与资产管理与后勤处负责解释。<br />\r\n&nbsp;&nbsp;&nbsp; 第十八条 本办法自2005年7月1日起执行。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
