INSERT INTO `dede_addonarticle` VALUES (5637, 140, '（2006年12月14日第11次校长办公会议通过）<br />\r\n根据长春市人民政府文件《长春市人民政府关于职工采暖费补贴有关事项的通知》（长府发〔2006〕26号）精神，结合我校实际，决定自2006－2007年采暖期起，集中供热和自供热住宅不再执行原来由学校统包供热及报销采暖费的办法，改为采暖费补贴直接发放给职工，由用热户直接向供热单位交纳采暖费。具体办法如下：<br />\r\n一、采暖费补贴范围和资金支付渠道<br />\r\n学校承担其工资的全民所有制职工，采暖费补贴由学校支付；学校不承担其工资的全民所有制职工，采暖费补贴由其所在企业或独立核算单位参照学校办法自行支付；大集体人员采暖费补贴由其所在具体用工单位支付；各临床医院职工，采暖费补贴可参照学校办法自行支付。<br />\r\n二、教职工采暖费补贴标准<br />\r\n采暖费补贴发放对象的住房面积标准，参照吉林省省直机关住房制度改革领导小组《关于印发吉林省省直机关进一步深化住房制度改革实施方案细则的通知》（吉直房改字［2000］2号）的规定标准执行：<br />\r\n正厅级150平方米，副厅级或正高级职称140平方米，处级或副高级职称110平方米，其他职工80平方米。<br />\r\n院士、资深教授、副部级干部采暖费补贴住房面积标准另行规定。<br />\r\n计算公式为：<br />\r\n职工年采暖费补贴额（元）=住房面积标准（平方米）&times;热价标准（元）／平方米&times;75%<br />\r\n离休人员按住房面积标准相应采暖费金额的85%补贴。<br />\r\n三、采暖费补贴核定工作流程<br />\r\n人事处负责提供在职教职工应补人员名单及职级（称）；离退休工作处负责提供离退休职工应补人员名单及职级（称）；党委组织部负责确认处级及以上领导干部职务；资产管理与资产管理与后勤处根据职务、职级（称）负责计算补贴金额，并由人事处负责核定；财务处负责将补贴进入工资。<br />\r\n四、采暖费补贴发放和交纳采暖费方式<br />\r\n根据学校经济状况，采暖费补贴在采暖期到来之前一次或分期发放给职工。集中供热用户按照市供热部门要求自行交费。居住学校自供热房屋的职工，采暖费从本人工资中扣除。<br />\r\n五、其它<br />\r\n1、遗属采暖费补贴范围及所需手续：<br />\r\n享受学校遗属生活补贴人员。需提供本人户口、身份证、住房产权证原件、采暖费发票及人事处生活补贴证明。住房面积控制标准为80 平方米。<br />\r\n2、住学校单身宿舍的职工，根据实际居住面积核算相应建筑面积后结算采暖费，在职工发放工资时扣除。<br />\r\n3、为确保2006－2007年采暖期能按时开栓供热，职工住宅采暖费由学校统一支付，再向职工个人或职工所在单位结算。<br />\r\n4、本办法自发布之日起实施。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
