INSERT INTO `dede_addonarticle` VALUES (5642, 125, '&nbsp;<br />\r\n<tt>为方便教职工办理房地产交易与权属登记业务，就学校教职工经常咨询的相关问题，学校房产管理办公室将长春市房地产交易中心部分业务的办理流程及所需要件进行了归纳整理（详见附件），供教职工参考。如有疑难问题需要咨询，可直接拨打长春市房地产交易中心热线电话：0431-88730934、88730935。</tt><br />\r\n<br />\r\n<br />\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<tt><a href="/uploads/soft/131125/1-131125131019.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></tt></td>\r\n			<td>\r\n				<tt><a href="/uploads/soft/131125/1-131125131019.doc" target="_blank"><u>业务办理流程</u></a></tt></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5781, 109, '<p>\r\n	校内各单位、相关教职工：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;现将咖啡小镇27套商品住房具体选房时间、地点、流程、要求等通知如下：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;一、选房人员：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;详见附件1。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;二、选房时间：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;2014年10月22日，上午9：00。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;三、选房地点：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;中心校区数学楼二楼多功能厅。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;四、选房流程：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;详见附件2。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;五、选房要求：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;1、申请人按时携带申请表所填有效证件（身份证或护照）到指定选房地点。若申请人不能到场，需被委托人执委托书、被委托人身份证原件、申请人身份证复印件代为选房。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;2、申请人只能另带一人陪同选房。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;3、选定的住房若为简装修住房，需现场交纳2万元定金，其余部分当天到咖啡小镇售楼处交纳（定金转为购房款）。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;4、选定的住房若为毛坯房，需现场交纳2万元定金，房款全额需当天到咖啡小镇售楼处交纳。全额交款后，执票据到学校财务处退还定金。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;5、交纳定金同时签订定金承诺书（协议见附件3）</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;6、当天若未全额交款，所选住房收回，定金不予退还。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;7、与开发商签订合同时间另行通知。</p>\r\n<p>\r\n	&nbsp;&nbsp;8、交费方式：所有交费均采用银联卡刷POS机方式，不收取现金（详见附件4）。</p>\r\n<p>\r\n	&nbsp;&nbsp;</p>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;附件一：<a href="/uploads/soft/141020/4-141020152T8.xls" target="_blank"><u>咖啡小镇购房申请人名单</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;<a href="/uploads/soft/141020/4-141020153407.doc" target="_blank"><u>附件二：咖啡小镇选房流程</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;<a href="/uploads/soft/141020/4-141020153634.doc" target="_blank"><u>附件三：定金承诺书</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;<a href="/uploads/soft/141020/4-141020154253.xls" target="_blank"><u>附件四：咖啡小镇27套房房屋价格出售表</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<div id="cke_pastebin">\r\n	&nbsp;</div>\r\n', '', '', '59.72.106.194');
