INSERT INTO `dede_addonarticle` VALUES (5646, 114, '<div style="text-align: center">\r\n	&nbsp;<br />\r\n	使用单位、校区后勤办提出维修计划<br />\r\n	&nbsp;<br />\r\n	后勤处技术人员现场踏查<br />\r\n	&nbsp;<br />\r\n	相关部门和领导会签<br />\r\n	&nbsp;<br />\r\n	后勤处立项<br />\r\n	&nbsp;<br />\r\n	招标文件准备<br />\r\n	&nbsp;<br />\r\n	招标与采购管理中心招标确定中标单位<br />\r\n	&nbsp;<br />\r\n	招标与采购管理中心签订合同<br />\r\n	&nbsp;<br />\r\n	监理公司、后勤处、校区后勤办施工管理<br />\r\n	&nbsp;<br />\r\n	后勤处、校区后勤办及使用单位验收、交接<br />\r\n	&nbsp;<br />\r\n	校区后勤办决算初审<br />\r\n	&nbsp;<br />\r\n	后勤处决算复审<br />\r\n	&nbsp;<br />\r\n	审计处决算审核<br />\r\n	&nbsp;<br />\r\n	财务处付款<br />\r\n	&nbsp;<br />\r\n	工程各类文书归档<br />\r\n	&nbsp;</div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5758, 124, '<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/131221/1-1312211S248.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/131221/1-1312211S248.doc" target="_blank"><u>吉林大学水、电、燃气查抄流程</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n联系人：刘长有<br />\r\n协助联系人：温凤义<br />\r\n联系电话：85166987<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5672, 126, '根据资产管理与资产管理与后勤处工作的性质，在日常工作中，会有大量的信访和接待工作，为使此项工作规范化，特制定本制度：<br />\r\n一、处办公室负责信访接待工作。<br />\r\n二、信函处理：<br />\r\n1、信件及来函，如属名，则由办公室转交本人。<br />\r\n2、资产管理与资产管理与后勤处信函，由办公室按信函内容，转送分管处长。<br />\r\n3、如属意见或投诉信类信函，首先登记，按性质及时送转分管处长，并将复印件转至所涉及部门，并及时将整改时间和结果反馈给办公室登记。<br />\r\n三、接待处理<br />\r\n1、凡来资产管理与资产管理与后勤处反映意见和投诉的，要热情接待，认真做好记录，并及时反映到所涉及的有关部门，要求反馈整改时间和效果。<br />\r\n2、凡属兄弟院校来考察后勤工作，由处办公室组织实行同级接待的原则。<br />\r\n3、凡属业务单位来检查指导工作的，实行对口接待的原则。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5673, 126, '为加强职工的政治思想、方针政策、业务技术学习，努力提高职工队伍政治素质、文化素质、业务素质，结合我处的工作特点，制定本制度：<br />\r\n一、学习目的<br />\r\n通过学习，使广大职工了解国际、国内形势，掌握党的路线方针政策和上级有关后勤管理法规政策，清楚自己的岗位职责，懂得自觉遵守各项规章制度，努力提高执行政策水平和业务技术能力，树立全心全意为教学、科研和广大师生员工服务的思想，力争达到全体职工团结一致，争先创优，推进我处各项工作的开展。<br />\r\n二、学习时间<br />\r\n1、每月初第一周的星期三下午政治学习。<br />\r\n2、其他星期三下午为业务学习和基本管理理论学习。<br />\r\n三、学习方式<br />\r\n1、政治学习为集中学习，党支部组织，处全体工作人员参加。<br />\r\n2、业务学习科室自行进行。<br />\r\n3、基本管理理论学习由处办公室组织，请领导或专家讲课。<br />\r\n四、学习内容<br />\r\n1、时事政治、政策、法规<br />\r\n2、先进人物事迹<br />\r\n3、学校有关会议、文件精神<br />\r\n4、各项规章制度<br />\r\n5、管理理论和业务技术<br />\r\n6、学校、资产管理与资产管理与后勤处及后勤党委规定的有关学习内容<br />\r\n五、学习要求<br />\r\n1、组织人员一定要认真负责，做好记录，处领导要经常深入到主管科室学习会场进行检查。<br />\r\n2、参加学习人员严格遵守学习时间，并做好学习笔记。学习期间无特殊情况不准请假。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5674, 126, '详情见附件\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130424/资产管理与资产管理与后勤处借款及报帐管理规定.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130424/资产管理与资产管理与后勤处借款及报帐管理规定.doc" target="_blank"><u>资产管理与后勤处借款及报帐管理规</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5726, 109, '<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;2013年10月17日上午，东北师范大学副校长张治国一行七人，来我校调研招标采购与后勤管理工作，招标与采购管理中心、资产管理与后勤处、节能办公室等相关人员参加了座谈会。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 座谈会在商贸楼415室举行，东北师范大学有关负责同志主要就如何加强高校后勤管理、如何应对招标采购中出现的各种问题以及能源监管平台建设等事宜前来进行调研学习。资产管理与后勤处常务副处长李宏伟首先代表杜莉总会计师和赵伟处长对张校长一行表示欢迎并介绍了我校资产管理与后勤处的基本情况。随后，我校招标采购管理中心主任朱磊对吉林大学校招标采购工作进行了详细的介绍，就后勤部门和招标采购部门的合作以及预算追加问题进行了一一解答。会上还就公房改革、校园除雪设备和除雪方式、校园绿化管理等问题交流了工作经验，就工作中存在的问题也做了详细的探讨。最后，学校节能办结合能源监管平台为东北师范大学做了具体介绍，针对平台建设前期的调研、对投标单位资质的审查、平台建设中的难点和重点和平台验收经验做了详细的解答。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 双方表示，希望能进一步加强两校间的沟通与交流，增进友谊，共同促进两校合作发展。</span><br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5676, 126, '为规范资产管理与资产管理与后勤处的印鉴和介绍信管理，特制定本规定：<br />\r\n一、必须按规定正确使用印鉴<br />\r\n1．发文时，所发文件须有拟稿人，核稿人签字，主管处长审阅，主管校长确认签发后，方可使用印鉴。<br />\r\n2．工作中发生的函件、证明、通知等，应由处长签字后方可使用印鉴。<br />\r\n3．重要的承诺，协议，文件等必须经处长签字后方可使用印鉴。<br />\r\n4．技术资料及乙方要求出具的证明、文件，需有项目负责人签字方可使用印鉴。<br />\r\n二、必须按规定使用介绍信<br />\r\n1．本处人员因公出差或参加会议时，需要证明身份和出差事由的，经主管处长批准，可出具介绍信。<br />\r\n2．处内人员因工作需要证明身份时，经主管处长批准，可出具介绍信。<br />\r\n3．处内人员因其他事由，须证明身份时，经处长批准，可出具介绍信。<br />\r\n三、使用印鉴时使用人应填写登记薄。注明内容及使用人。<br />\r\n四、印鉴、介绍信由人妥善保管，不得遗失，不得损坏。<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5677, 126, '<br />\r\n详情见附件<br />\r\n<br />\r\n<br />\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130424/资产管理与后勤处预算及经费支出管理办法（暂行）.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130424/资产管理与后勤处预算及经费支出管理办法（暂行）.doc" target="_blank"><u>资产管理与后勤处预算及经费支出管理办法 （暂行）</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5687, 109, '<span style="font-size: 16px">&nbsp;&nbsp;&nbsp; 为了推进我校公用房有偿使用管理改革和后勤社会化管理改革的工作进程，4月17日至22日，总会计师杜莉教授带领资产管理与后勤处有关同志先后到华南理工大学、华南师范大学、中山大学进行调研。随后，受杜莉总会计师的委托，资产管理与后勤处一行又访问了武汉大学、武汉理工大学和华中农业大学。<br />\r\n&nbsp;&nbsp;&nbsp; 调研期间，杜莉总会计师就公用房的使用管理情况和改革举措、改革中遇到的困难和对策，以及后勤社会化托管的进展情况、利弊分析等问题与各高校主管校领导或相关职能部门的领导进行了深入交流，详细了解了各兄弟院校实施公用房有偿使用改革和后勤社会化托管的进程、方法和经验。<br />\r\n&nbsp;&nbsp;&nbsp; 通过此次调研，拓宽了我校实施公用房有偿使用改革和后勤社会化托管的工作思路，对于制定出适合我校的公用房有偿使用和后勤社会托管办法，将会起到很好的学习借鉴作用。 </span>\r\n<div>\r\n	<span style="font-size: 16px"><img alt="000" src="/uploads/allimg/130502/1-130502133612548.png" /></span><br />\r\n	&nbsp;</div>\r\n<div style="text-align: right">\r\n	<br />\r\n	2013年5月2日</div>\r\n', '', '', '59.72.106.131');
INSERT INTO `dede_addonarticle` VALUES (5688, 109, '<p>\r\n	校内各单位：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;为加强干部队伍建设，进一步规范科级干部选拔任用工作，提高管理服务效能，按照学校有关要求及工作安排，资产管理与后勤处决定在全校范围内选拔聘任科级干部及工作人员。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;一、组织领导</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;为做好本次科级干部及工作人员选拔任用工作，成立&ldquo;资产管理与后勤处科级干部选拔聘任工作领导小组&rdquo;（以下简称&ldquo;领导小组&rdquo;），负责干部选拔任用工作的具体实施。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;组&nbsp;&nbsp;长：赵&nbsp;&nbsp;伟</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;副组长：李宏伟</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;成&nbsp;&nbsp;员：张&nbsp;&nbsp;敏、李青山、王德国、张德玉、高殿国</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;周伟亚、胡志春</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;二、科室设置及岗位职数</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;具体科室设置及岗位职数见附件1。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;三、聘任资格</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;应聘人员须符合《吉林大学科级干部选拔任用实施办法》、《关于开展科级干部及管理人员重新聘任工作的通知》（校人字〔2013〕58号）文件规定的基本条件。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;四、其他要求</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;1.原则上在同一岗位连任两届及以上的科级干部需进行岗位轮换。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;2.原则上年龄在40岁左右及以下的正科级干部应占正科级干部总数1/3以上；原则上年龄在35岁及以下的副科级干部占副科级干部总数1/2以上。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;五、工作程序</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;本次科级干部及工作人员选拔聘任工作采取自愿申报、竞争上岗的方式进行，具体工作程序如下。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;1．公开报名。5月6日&mdash;7日，符合招聘条件和资格的人员报名，填写《科级干部及工作人员岗位申报表》（附件2），同时提供身份证、毕业证、学位证、获奖证书等材料复印件一份，于5月7日16时前报资产管理与后勤处，申报表电子版发送至zhangmin@jlu.edu.cn。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;报名地点：商贸楼306室</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;联 系 人：张&nbsp;&nbsp;敏&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 电话：85168018</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;3．资格审查。领导小组对申报人员进行资格审查，并对审查合格者进行公布。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;4．竞聘述职。资格审查合格人员向考评组作竞聘述职，竞聘陈述及述职报告内容为任现职以来的主要工作业绩、申报理由及工作设想（包括对申报岗位的理解和认识），重点阐述工作设想及实现工作设想的措施，时间不超过5分钟，并回答考评组现场提问。述职地点另行通知。申报工作人员岗位人员不需述职，只需提交申报材料。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;竞聘时间：5月9日8:30&mdash;11:30</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;5．确定拟聘人选。领导小组根据考评结果及申报人现实表现，提出拟聘人选建议名单，在校内进行公示。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;6．审批任命。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 资产管理与后勤处</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013年5月6日</p>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5692, 94, '&nbsp;&nbsp; 由于我校机构改革，原后勤处、国有资产处和国土资源管理办公室并为资产管理与后勤处。2013年5月9日原国有资产处和国土资源管理办公室已经完办公室搬迁工作，现工作地点以及联系方式如下：<br />\r\n<br />\r\n<table align="left" border="1" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				名称</td>\r\n			<td style="width: 168px">\r\n				地点</td>\r\n			<td style="width: 189px">\r\n				电话</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				处长室（李宏伟）</td>\r\n			<td style="width: 168px">\r\n				商贸楼407-1室</td>\r\n			<td style="width: 189px">\r\n				85159281</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				处长室（李青山、高殿国）</td>\r\n			<td style="width: 168px">\r\n				商贸楼407-2室</td>\r\n			<td style="width: 189px">\r\n				85151088</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				固定资产管理科</td>\r\n			<td style="width: 168px">\r\n				商贸楼410室</td>\r\n			<td style="width: 189px">\r\n				85151098</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				机动车管理科</td>\r\n			<td style="width: 168px">\r\n				商贸楼401-2室</td>\r\n			<td style="width: 189px">\r\n				85151028</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				无形资产管理科</td>\r\n			<td style="width: 168px">\r\n				商贸楼406室</td>\r\n			<td style="width: 189px">\r\n				85151085</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				产权管理科</td>\r\n			<td style="width: 168px">\r\n				商贸楼402室</td>\r\n			<td style="width: 189px">\r\n				85151099</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				公用房管理科</td>\r\n			<td style="width: 168px">\r\n				商贸楼401-1室</td>\r\n			<td style="width: 189px">\r\n				85166989</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width: 211px">\r\n				国土资源管理办公室</td>\r\n			<td style="width: 168px">\r\n				商贸楼403室</td>\r\n			<td style="width: 189px">\r\n				85159282</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<div>\r\n	<br />\r\n	&nbsp;</div>\r\n', '', '', '211.151.238.51');
