INSERT INTO `dede_addonarticle` VALUES (5707, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;根据人社处《关于开展2011年和2012年专业技术职务聘任工作的通知》要求，现将资产管理与后勤处专业技术职务评议与聘任专家小组和专业技术职务评议与聘任工作小组人员名单予以公示，详见附件。<br />\r\n<br />\r\n<br />\r\n<br />\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130603/1-130603125616.xls" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130603/1-130603125616.xls" target="_blank"><u>资产管理与后勤处专业技术职务评议与聘任工作小组成员人选推荐表</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130603/1-130603125P2.xls" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130603/1-130603125P2.xls" target="_blank"><u>资产管理与后勤处专业技术职务评议与聘任专家小组成员人选推荐表</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5708, 111, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <st1:chsdate day="24" islunardate="False" isrocdate="False" month="5" w:st="on" year="2013"><span lang="EN-US" style="font-size: 14pt; font-family: 仿宋_GB2312">5</span><span style="font-size: 14pt; font-family: 仿宋_GB2312">月<span lang="EN-US">24</span>日</span></st1:chsdate><span style="font-size: 14pt; font-family: 仿宋_GB2312">日上午，资产管理与后勤处在东荣大厦第一会议室召开会议，会议由常务副处长李宏伟主持，全体处领导及新聘任科级岗位人员参加了大会。<span lang="EN-US"><o:p></o:p></span></span>\r\n<p style="text-indent: 24pt">\r\n	<span style="font-size: 14pt; font-family: 仿宋_GB2312">会议按照学校相关工作要求，宣布了处内科级岗位任命结果。会上，赵伟处长对新聘任的<span lang="EN-US">24</span>名科级干部表示祝贺，对大家以往的工作能力给予了充分肯定，希望大家在今后的共工作中发挥聪明才智，快速进入工作角色，扎实工作，摆明态度，凝心聚力，创造新的辉煌。此外，赵伟处长对全体工作人员提出了四点要求：一是要专研业务、勤学善问，精通本职工作；二是要坦诚工作，加强各部门之间的沟通和协作，以诚相待、促进融合；三是要敢于担当，以强烈的事业心和责任心对待工作，勇于担负起各项业务及改革任务的重任，不辜负师生和学校对大家的期望和重托；四是要树立正确的价值观，工作中充分发挥每个人的作用，实现个人价值与事业进步的和谐发展。<span lang="EN-US"><o:p></o:p></span></span></p>\r\n<p style="text-indent: 24pt">\r\n	<span style="font-size: 14pt; font-family: 仿宋_GB2312">最后，常务副处长李宏伟做总结发言，希望新聘任的科级干部要团结一心，拿出成绩，为吉林大学的发展贡献智慧和力量。&nbsp;</span><br />\r\n	&nbsp;</p>\r\n<p style="text-indent: 24pt; text-align: center">\r\n	<span style="font-size: 14pt; font-family: 仿宋_GB2312"><img alt="" data-pinit="registered" height="393" src="/uploads/allimg/130605/1-130605102Gc12.png" style="width: 573px; height: 316px" width="752" /></span></p>\r\n<p style="text-indent: 24pt">\r\n	<br />\r\n	&nbsp;</p>\r\n<p style="text-indent: 24pt; text-align: center">\r\n	<span style="font-size: 14pt; font-family: 仿宋_GB2312">&nbsp;</span></p>\r\n<p style="text-indent: 24pt; text-align: center">\r\n	&nbsp;&nbsp;</p>\r\n<p style="text-indent: 24pt; text-align: center">\r\n	<span style="font-size: 14pt; font-family: 仿宋_GB2312">&nbsp;</span></p>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5710, 109, '<p>\r\n	<br />\r\n	<br />\r\n	处内各科室：<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据人力资源与社会保障处《关于开展2011年和2012年专业技术职务聘任工作的通知》及《关于2011年和2012年专业技术职务聘任工作表格填写及材料报送要求的通知》中的相关要求，2013年6月3日（星期一）-6月13日（星期四）为个人申报及中层单位资格审查阶段。<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 请各位同志根据通知内聘任条件及表格填写的相关要求，结合个人情况填写相关系列的《申报表》，并于2013年6月6日下班前将电子版发送至综合管理科，邮箱：<a href="mailto:maxinlei@jlu.edu.cn">maxinlei@jlu.edu.cn</a>，申报过程的相关问题咨询请拨打电话：85166542。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 资产管理与后勤处</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013年6月3日</p>\r\n', '', '', '211.151.238.51');
