INSERT INTO `dede_addonarticle` VALUES (5714, 94, '<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 14px"> 为便于管理，我处将原在南湖校区的&ldquo;吉林大学国有资产综合管理平台&rdquo;服务器搬迁到南区商贸楼，<br />\r\n<br />\r\n新的IP地址为：<a a="" href="http://10.60.16.146/" target="_blank"><font color="#0000ff">http://10.60.16.146/</font></a>，或登录资产后勤主页，点击&ldquo;国有资产管理&rdquo;进入。</span>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;资产管理与后勤处</p>\r\n<p style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2013年6月7日</p>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5711, 109, '<p style="color: blue">\r\n	<span style="font-size: 14px">&nbsp;<span style="color: #000000">处内各科室：</span></span></p>\r\n<p style="color: blue">\r\n	<span style="font-size: 14px"><span style="color: #000000">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 由于学校机构改革，我处各科室职能也发生相关变化，请各位科室负责人，根据目前科室相关职能<br />\r\n	<br />\r\n	重新拟定各科室工作职责，并于2013年6月8日之前，发送电子版到</span><a href="mailto:发送电子版到xiedan@jlu.edu.cn"><span style="color: #000000">xiedan@jlu.edu.cn</span></a><span style="color: #000000">.&nbsp;&nbsp;<br />\r\n	&nbsp;</span></span></p>\r\n<h5 style="color: blue">\r\n	&nbsp;</h5>\r\n<p style="color: blue">\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<span style="font-size: 14px"><span style="color: #000000">&nbsp;</span></span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5773, 109, '<span style="font-size: 16px">&nbsp;&nbsp;&nbsp; 2014年7月5日上午，资产管理与后勤处邀请中科院长春化学应用研究所张洪杰院士到我校做了《稀土发光材料在LED照明中的应用》技术报告并开展了相关业务的研讨，学校资产管理与后勤处、后勤服务集团、基建处相关负责人及技术人员参加了报告会。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 会上张洪杰院士针对稀土发光材料在LED照明中的优点进行了详细的阐述并与白炽灯、荧光灯和其他LED灯等节能设备的优势做了鲜明的对比；同时也向大家介绍了张洪杰院士自行研究的交流式LED照明灯在日常生活中的应用。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 通过讲解，参会人员对LED照明灯在日常生活中的应用及节能效果有了更深的了解；资产管理与后勤处相关人员、后勤服务集团总经理就将交流式LED照明灯在学校进行推广事宜同张洪杰院士做了深入的探讨，为我校继续开展校绿色校园建设工作奠定了基础。</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '59.72.106.153');
INSERT INTO `dede_addonarticle` VALUES (5717, 109, '&nbsp;<br />\r\n处内各科室：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 由于工作需要，我处需呈报主管校长签批的文件较多，为简化签批程序，提高工作效率，现将《文件呈报单》共享与处内网站（见附件），请大家按需下载，需要呈报的文件需先填写好文件标题及主管副处长意见后，交由综合科统一呈报。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 备注:日期及编号由综合科统一编号填写。<br />\r\n&nbsp;<br />\r\n<br />\r\n附件：文件承报单<br />\r\n&nbsp;\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/130813/1-130Q3102019.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/130813/1-130Q3102019.doc" target="_blank"><u>文件呈报单</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n&nbsp;\r\n<div style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;综合管理科</div>\r\n<div style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013年8月13日</div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5716, 109, '&nbsp;&nbsp;&nbsp;&nbsp; 2013年7月9日上午，杜总会计师在资产管理与后勤处相关负责人的陪同下，视察了我校的修缮工程项目施工情况以及东湖周边建设情况。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; 杜总会计师，先后视察了朝阳校区七公寓综合维修、新民校区八公寓综合维修、南岭校区六公寓综合维修、前卫北区八舍综合维修和鸣放宫维修、中心校区翠文楼楼体外墙面拆除、楼内教室维修以及室内照明改造等正在进行的主要修缮工程，对各单位在施工前期准备、施工方案以及施工安全方面所做的工作给予了充分肯定。同时现场询问了施工单位的资质、工程进度和施工的难点等等，并对施工过程所遇到的问题给予了详细的指导。视察中，杜总会计师强调要把改善学生住宿和学习条件放在工作首位，充分利用现有资金切实解决关系学生学习、生活条件的重要问题，在工程用料选材上一定要严把质量关，严格遵守各项&nbsp; 安全要求，确保学生的人身安全。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; 最后杜总会计师来到我校东湖，现场查看了东湖建设情况。目前东湖周边建设已经初见规模，湖心岛、湖周边石板路、周边绿化美化工程都在有序进行着；东湖的建设打造了多层次、立体化的绿化景观体系，使校园绿化整体水平得到了提高。<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n&nbsp;<br />\r\n&nbsp;<img height="567" src="file:///C:\\DOCUME~1\\ADMINI~1\\LOCALS~1\\Temp\\msohtml1\\01\\clip_image001.png" style="width: 670px; height: 566px" width="469" /><br />\r\n&nbsp;<br />\r\n&nbsp;', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5720, 94, '&nbsp; <span style="font-size: 16px">各位党员：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 按照党的群众路线教育实践活动学习教育工作安排，除了学习制定的书籍和讲话、写读书比较之外，还要求全体党员干部要根据学习收获和体会撰写不少于3000字的学习心得或理论文章，《吉林大学报》以专栏或专刊形式选登优秀文章，所有党员干部要求在9月18日之前交到党支部，处级以上干部学习成果要求9月18之前报机关党委！</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<div style="text-align: right">\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 资产管理与后勤处党支部</span></div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5721, 109, '&nbsp;&nbsp;&nbsp;<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2013年8月20日，资产管理与后勤处在东荣报告厅召开深入开展召开党的群众路线教育实践活动工作部署会议。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 会上，资产管理与后勤处赵伟处长就我处深入开展党的群众路线教育实践活动进行了再动员和再部署，并结合全处今年的工作任务号召全体党员干部进一步提高对党的群众路线教育实践活动的认识，要认真学习，严格按照学校要求开展好党的群众路线教育实践活动，积极主动投身到学校资产改革、后勤改革实践中，做到开展教育实践活动与推进工作两手抓、两不误、两促进。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 按照校教育实践活动领导小组领导办公室《关于对处级以上领导班子和处级以上干部开展工作作风情况民主评议工作的通知》要求，支部书记李宏伟同志主持开展了对处领导班子和班子成员及处级专员的评议工作。</span><br />\r\n<br />\r\n<br />\r\n<div style="text-align: right">\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp; 资产管理与后勤处</span><br />\r\n	&nbsp;</div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5722, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style="font-size: 14px">9月10日，党委办公室、财务处、招标与采购管理中心、资产管理与后勤处全体党员在东荣大厦多功能厅共同听取了吉林大学马克思主义学院韩喜平教授关于党的群众路线教育学习专题辅导讲座。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 韩教授以&ldquo;党的群众路线教育活动的必要性及其途径&rdquo;为主题，对开展党的群众路线教育实践活动进行了深刻的分析和阐述。韩教授用例子详细讲解了形式和形式主义的区别；分别从党的发展战略、党的性质、党的历史以及党面临的环境四个方面充分分析了认识党的群众路线教育实践活动的必要性，并强调指出，当前我国正处在全面建设小康社会的关键时期和深化改革开放、加快转变经济发展方式的攻坚时期，党所面临的执政考验、改革开放考验、市场经济考验、外部环境考验更加突出，我党想要经受住这&ldquo;四大考验&rdquo;，没有牢固的根基&mdash;&mdash;人民群众的拥护和支持是不可能的。最后，韩教授又从&ldquo;办实事、改体制、正风气、建制度&rdquo;等方面对群众路线教育实践活动路径做了深入分析，并给大家提出了宝贵建议。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 与会同志认真听讲，做好记录并结合工作实际深入思考，同志们进一步认识到了党的群众路线教育实践活动的必要性和重要性。此次的专题辅导必将深入的促进党的群众路线活动在各处的深入展开，必将对各处在群众路线教育实践过程中起到极大的推进作用。</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5723, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据校部机关党的群众路线教育实践活动领导小组下发的《关于校部机关教育实践活动近期开展工作》的通知要求，我处于2013年9月16日上午9：00&mdash;&mdash;11:30在商贸楼401室开展个别谈话听取意见工作，由本单位负责人&ldquo;面对面&rdquo;听取本单位职工意见，欢迎处内同志对我处领导班子及领导班子成员提出宝贵意见和建议。<br />\r\n&nbsp;<br />\r\n&nbsp;</span>\r\n<div style="text-align: right">\r\n	<span style="font-size: 16px">资产管理与后勤处<br />\r\n	二〇一三年九月十三日</span><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5724, 109, '&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<span style="font-size: 16px">为贯彻学校及机关党委关于党的群众路线教育实践活动的相关要求，9月17日，资产管理与后勤处在学校北区召开了党的群众路线教育实践活动征求意见座谈会。资产管理与后勤处全体领导班子成员深入校区，结合工作实际及特点，邀请了北区综合办公室、南湖校区综合办公室、东区综合办公室、白求恩医学部、后勤服务集团以及资产经营公司的主要负责同志参加座谈会。会议由资产管理与后勤处常务副处长李宏伟主持。</span>\r\n<p>\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;座谈会上，资产管理与后勤处领导班子认真征求了各单位代表关于&ldquo;四风&rdquo;方面的意见和建议，与会人员结合本部门工作交流体会、畅谈心得，并针对&ldquo;四风&rdquo;问题对处领导班子及成员进行了全面的评议，一致肯定了处领导班子深入校区、服务群众的工作作风，同时就校园建设、楼宇修缮等工作方面，提出了真切建议和殷切希望。</span></p>\r\n<p>\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;会议最后，李宏伟代表资产管理与后勤处领导班子总结了会上提出的建议和意见，并要求领导班子成员对照群众意见和&ldquo;四风&rdquo;查找问题、立查立改，制定并落实整改措施，确保教育实践活动取得实效。</span></p>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5725, 109, '&nbsp;&nbsp;&nbsp;<span style="font-size: 16px"> &nbsp;根据学校教育实践活动领导小组的统一部署和安排，9月26日上午，资产管理与后勤处在逸夫图书馆202会议室召开党的群众路线教育活动专题学习讨论会，会议由资产管理与后勤处常务副处长李宏伟主持，机关党委副书记郁俊义、组织部副部长鲍锋等教育实践活动督导组领导及资产管理与后勤处全体党员参加了本次会议。</span>\r\n<p>\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;资产管理与后勤处领导班子成员结合开展党的群众路线教育活动以来参加学习、听取意见以及工作实际进行了逐一发言，从理论和实践的角度分别深刻谈了对党的群众路线的认识；查摆了&ldquo;四风&rdquo;在自身的现实表现；并结合自身分管的工作，对开展教育实践活动和做好资产后勤工作提出了意见和建议。</span></p>\r\n<p>\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;督导组组长鲍锋同志对资产管理与后勤处在本次&ldquo;群众路线教育实践活动&rdquo;中的工作表示了肯定，同时也高度评价领导班子成员的发言&ldquo;认识有深度，思想有高度&rdquo;并要求领导班子负责人要充分重视个别谈话听取意见和专题学习讨论会在群众路线教育实践活动中的意义，要让群众看到我们不是在走过场，是在追求实效；要进一步加强学习和提高认识；要对征求到的意见认真分析，加大执行力度，办实事，讲效率。</span></p>\r\n<p>\r\n	<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;最后常务副处长李宏伟做了总结讲话，感谢群众路线教育实践活动督导组和机关党委对资产管理与后勤处教育实践活动的指导，并要求资产管理与后勤处全体党员要进一步注重党性的修养，在坚持党的群众路线的基础上继续深入的开展业务学习，提高服务师生的能力，进一步增加广大师生的满意度。此次的群众路线教育专题学习讨论会，为我处今后党的群众路线教育实践活动工作奠定了坚实的基础，对我处下一步群众路线教育工作安排有重要的指导意义。</span></p>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5729, 125, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><br />\r\n<strong>针对事项：</strong>房改档案中，工龄有误，需要退工龄，并补交房款。<br />\r\n<strong>办理流程：</strong><br />\r\n<strong>第一步，</strong>根据档案馆提供的档案、售房价格计算公式，核算出应补交房款金额，并将计算公式及过程注明于更正证明表中。<br />\r\n<strong>第二步，</strong>到长春市公积金管理中心交款（见备注交款账号），并复印交款凭证。<br />\r\n<strong>第三步，</strong>根据交款凭证复印件到长春市房改办办理以下两件事宜：第一，开具交款收据；第二，领取发票批件。<br />\r\n<strong>第四步，</strong>根据长春市房改办提供的材料（交款收据、发票批件），到长春市财政局政务大厅，购买国有住房出售统一票据（共四联，其中政务大厅留存第一联）。<br />\r\n<strong>第五步，</strong>携带交款收据、国有住房出售发票和银行交款凭证复印件，到吉林大学房产管理办公室办理后续事宜。<br />\r\n<strong>备注：</strong><br />\r\n<p>\r\n	1.交款账号及开户行：</p>\r\n全称：长春市城镇住房制度改革领导小组办公室<br />\r\n开户行：建设银行同志街支行<br />\r\n账号：<strong>22001480100055000095</strong><br />\r\n<p>\r\n	2.长春市公积金管理中心地址：同志街与东朝阳路交汇处，同志街698号。</p>\r\n<p>\r\n	3.长春市房改办地址：景阳大路与西环城路交汇处。</p>\r\n4.长春市财政局政务大厅地址：湖西路与普阳街交汇处。<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5732, 109, '<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp; <span style="font-size: 18px">2013年11月 27日，吉林农业大学副校长张立峰一行十三人，来我校调研节能监管平台建设工作，资产管理与后勤处常务副处长李宏伟、节能办公室主任胡志春等工作人员参加了座谈会。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 座谈会在商贸楼415室举行，首先资产管理与后勤处常务副处长李宏伟代表杜莉总会计师和赵伟处长对张校长一行表示欢迎，并介绍了我校资产管理与后勤处的基本情况，随后节能办主任胡志春结合能源监管平台为吉林农业大学做了详细的演示。会议上，双方就能源监管平台建设的立项、调研、招标、建设和验收等问题进行深入交流，张立峰副校长对我校能源节能监管平台给予充分肯定和赞许，同时也希望加强两校在节约型校园建设方面的深层次合作。会议在融洽的气氛中结束。</span></span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5733, 109, '&nbsp;&nbsp;&nbsp;<span style="font-size: 14px"> 2013年12月5日，资产管理与后勤处在东荣第二会议室召开党的群众路线教育实践活动领导班子专题民主生活会。杜莉总会计师应邀参加并发表讲话，校群众路线教育实践活动第五督导小组组长鲍锋、成员金鑫出席了会议，资产管理与后勤处领导班子全体成员参加了会议。<br />\r\n&nbsp;&nbsp;&nbsp; 会议由资产管理与后勤处处长赵伟主持。赵伟处长首先代表资产管理与后勤处领导班子进行了对照检查发言。从领导班子遵守党的政治纪律、贯彻落实中央八项规定和转变作风情况、查摆了 &ldquo;四风&rdquo;方面存在的突出问题、并分析了产生这些问题的原因、同时明确提出了今后的努力方向和整改措施。<br />\r\n&nbsp;&nbsp;&nbsp; 随后，领导班子成员依次作个人对照检查发言，以整风精神开展批评和自我批评。班子成员之间结合工作实际开展相互批评和帮助，大家坦诚相待、真心实意、相互揭短，对于提出的意见建议，都作了积极的回应，表示虚心接受、深刻领会，一定在今后的工作和学习中认真整改。<br />\r\n鲍锋代表督导小组发言，他对资产管理与后勤处党的群众路线教育实践活动的开展和取得的成果给予了充分肯定。认为民主生活会准备充分、自我批评重点突出，相互批评坦诚善意，边查边改反馈良好。对下一步工作提出三点要求：一是抓紧做好民主生活会情况通报工作；二是切实抓好整改落实；三是坚持常抓不懈推进作风建设。<br />\r\n&nbsp;&nbsp;&nbsp; 赵伟处长对本次处班子民主生活会进行了总结，他首先对学校督导组对我处党的群众路线教育实践活动的指导和帮助表示衷心地感谢，强调近期着重做好三项工作：一是要认真梳理会议中提出的问题，结合工作实际，集中精力抓整改落实；二是要严格按照督导组的意见，进一步转变工作作风，三是希望大家以党员标准严格要求自己，推进学校资产后勤工作上台阶、上水平。<br />\r\n&nbsp;&nbsp;&nbsp; 最后，杜总会计师作重要讲话，她指出资产管理与后勤处领导班子民主生活会准备充分、批评与自我批评深刻、达到了预期效果，为了进一步做好整改落实工作，提出六点要求：一是抓好整改，建立长效机制，使活动形成理论成果、实践成果和制度成果；二是规范管理、完善制度，用制度约束行为；三是转变作风，做到深入、敬业、踏实、精细化；四是始终以共产党员标准严格要求自己，做到精诚团结、相互支持；五是敢于担当，做到履职尽责；六是坚持反腐倡廉，做到廉洁从政。</span><br />\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5734, 109, '<div>\r\n	&nbsp;<span style="font-size: 16px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style="font-size: 20px">2013年12月9日下午，资产管理与后勤处在匡亚明楼第二会议室召开了党的群众路线教育实践活动领导班子专题民主生活会通报会，校第五督导组组长鲍锋、成员金鑫和处全体员工参加了会议。会议由赵伟主持，赵伟处长按照学校要求，对处领导班子专题民主生活会的前期准备情况、会议中对聚焦&ldquo;四风&rdquo;查摆出的主要问题、问题产生的主要原因、努力方向及整改措施、班子成员开展批评与自我批评情况、督导组同志的指导意见、建议和下一步工作部署做了全面的通报，并传达了主观校领导杜莉总会计师的重要讲话精神。同时赵伟处长感谢全处同志在教育实践活动过程中对班子及班子成员的关心与支持，感谢大家提出中肯的宝贵意见和建议，并表示处领导班子将以此次实践教育活动为契机，认真制定整改方案，落实好各项整改措施，努力建立长效机制，使实践教育活动取得实效。</span></span><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</div>\r\n', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5735, 94, '<span style="font-size: 18px">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日，我校受&ldquo;中国绿色大学联盟&rdquo;邀请，成为该联盟成员单位。中国绿色大学联盟是在国家住房和城乡建设部建筑节能科技司和国家教育部社会规划司等有关部门领导下，按照&ldquo;自愿、平等、共赢&rdquo;的原则发起成立的中国建筑节能协会下属的二级团体机构。目前联盟全国共有24所高校，2所科研单位。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 联盟的主要目的是加强大学间在绿色校园建设领域的合作交流，为国家和地方政府制定推进绿色校园建设节能管理提供数据和科技支撑，促进校园设施及建筑节能减排技术创新、合作研发和推广，培养校园节能减排领域高级人才，发挥绿色大学建设的引领作用。</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', '', '', '211.151.238.51');
