INSERT INTO `dede_addonarticle` VALUES (5751, 120, '&nbsp;在线填写申请表（中国版权保护中心）&rarr;到学校软件登记管理部门（资产管理与后勤处无形资产管理科）办理手续&rarr;提交申请文件（邮寄）&rarr;缴纳申请费&rarr;登记机构受理申请&rarr;补正申请文件（非必须程序）&rarr;取得登记证书<br />\r\n●<strong>中国版权保护中心（www.ccopyright.com.cn）</strong>是国家版权局认定的唯一的软件登记机构，目前除北京地区设有代办机构，外地申请者可以通过邮寄申请文件办理。<br />\r\n<strong>1.</strong><strong>填写申请表</strong>：在中国版权保护中心的网站上，首先进行用户注册，然后用户登陆，在线按要求填写申请表后，确认、提交并打印。<br />\r\n<strong>2.</strong><strong>到资产管理与后勤处无形资产管理科办理手续时需提供</strong>：<br />\r\n&nbsp;&nbsp; ① 在线打印的软件登记申请表一式两份<br />\r\n&nbsp;&nbsp; ② 吉林大学软件登记审查表一式两份（在资产管理与后勤处主页相关下载中）<br />\r\n<strong>3.</strong><strong>提交申请文件</strong><br />\r\n&nbsp;&nbsp; ① 盖章的软件著作权登记申请表（一份）<br />\r\n&nbsp;&nbsp; ② 软件的鉴别材料（一份）<br />\r\n&nbsp;&nbsp; ③ 申请人身份证明（一份事业单位法人证书，由软件登记管理部门提供）<br />\r\n&nbsp;&nbsp; ④ 其他文件视材料中的具体情况而定。<br />\r\n▲<strong>软件的鉴别材料</strong>：包括一般交存和例外交存<br />\r\n&nbsp; &nbsp;<strong>一般交存</strong>：源程序和文档应提交前、后各连续30页，不足60页的，应当全部提交；<br />\r\n&nbsp;&nbsp; <strong>例外交存</strong>：可以选择以下三种方式之一：<br />\r\n&nbsp;&nbsp; ①&nbsp; 源程序的前、后各连续30页，其中的机密部分用黑色宽斜线覆盖，但覆盖部分不得超过交存源程序的50％；<br />\r\n&nbsp;&nbsp; ②源程序连续的前10页，加上源程序的任何部分的连续的50页；<br />\r\n&nbsp;&nbsp; ③目标程序的前、后各连续的30页，加上源程序的任何部分的连续的20页。<br />\r\n&nbsp;&nbsp; <strong>注：</strong><strong>源程序和文档应在页眉上标注相应的软件名称和版本号，右上角应标注页码，源程序每页不少于50行，文档每页不少于30行。</strong><br />\r\n▲<strong>权利归属的证明文件</strong><br />\r\n&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&bull;委托开发的,应当提交委托开发合同；<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&bull;合作开发的, 应当提交合作开发合同；<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&bull;下达任务开发的, 应当提交上级部门的下达任务书。<br />\r\n<strong>4.</strong><strong>缴纳申请费</strong><br />\r\n&nbsp; 申请文件符合受理要求时，软件登记机构发出缴费通知，申请人或代理人按照通知要求缴纳费用。<br />\r\n<strong>5.</strong><strong>登记机构受理申请</strong><br />\r\n&nbsp; 申请文件符合受理要求并缴纳申请费的，登记机构在规定的期限内予以受理，并向申请人或代理人发出受理通知书及缴费票据。<br />\r\n<strong>6.</strong><strong>补正程序</strong><br />\r\n&nbsp; 申请文件存在缺陷的，申请人或代理人应在规定期限内补正，逾期不补正的，申请将被视为撤回；经补正仍不符合登记办法的，登记机构将不予登记并书面通知申请人或代理人。<br />\r\n<strong>7.</strong><strong>获得登记证书</strong><br />\r\n&nbsp; 如到登记受理大厅领取证书，应当在受理之日起30个工作日后，持受理通知书原件领取证书。如需邮递的，请在申请表中填写正确的联系地址。<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n办理时间：周一至周五&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办理地点：商贸楼403室<br />\r\n负责人：李健&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 联系方式：85151085<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n', '', '', '211.151.238.51');
