INSERT INTO `dede_addonarticle` VALUES (5753, 125, '1、按照人事处要求，遗属到人事处审核资格；<br />\r\n2、每年12月底前，人事处将遗属名单统一交给房产管理办公室；<br />\r\n3、次年1月至4月，遗属执房证、采暖费发票、户口、身份证、工资折到房产管理办公室登记；<br />\r\n4、房产管理办公室登记后，上报学校财务处；<br />\r\n5、发放采暖补贴。<br />\r\n&nbsp;<br />\r\n<br />\r\n<br />\r\n办理时间：正常工作日<br />\r\n办理地点：商贸楼309室<br />\r\n负责人：陈永波<br />\r\n联系方式：85166543<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n', '', '', '211.151.238.51');
