INSERT INTO `dede_addonarticle` VALUES (5762, 109, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;<span style="font-size: 16px">按照学校党委的统一部署及处内的工作安排，资产管理与后勤处于2014年3月21日下午召开党的群众路线教育实践活动暨2014年工作布置会议，处领导班子及全处职工参加会议，会议由高殿国副处长主持。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;高殿国同志对我处开展党的群众路线教育实践活动进行了全面总结。我处的教育实践活动在深入学习、听取意见、查摆问题、开展自我批评、整改落实、建章立制等各个阶段都取得了良好的效果，确保了教育实践活动取得实效，受到了学校督导组的肯定。尤其是我处的各项改革工作取得了初步的成功，也得到了校领导的称赞。在下一步的资产管理体制改革及后勤管理体制改革工作中，全处干部职工将进一步巩固群众路线教育实践活动成果，全面深化改革。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 随后，全体与会同志对处领导班子、党员处级领导干部开展教育实践活动的情况进行了民主评议。会议第二项，赵伟处长对2014年资产管理与后勤处各项工作进行了全面布置。资产管理与后勤处将进一步巩固各项资产、后勤改革成果，全面推进未完成改革事项的进程，同时做好&ldquo;国有资产管理年&rdquo;相关工作，努力在工作内容、工作制度及管理机制方面取得创新和突破，实现&ldquo;精心、精细、精致&rdquo;的工作目标。健全管理制度，强化基础工作，对学校资源的基础数据进行核查、登记入库，并利用管理平台对入库数据进行有效管理，同时建设完成中心校区三维校园综合信息管理系统，提高管理效率及加强校园修缮建设及服务等。处领导班子及全处干部职工要进一步增强服务意识、提升工作质量，全面深化改革，推动内涵建设。</span>', '', '', '211.151.238.51');
INSERT INTO `dede_addonarticle` VALUES (5770, 109, '<span style="font-size: 14px">2014年是中国共产党成立93周年，为了回顾党的光辉历程和伟大成就，继承和弘扬党的优良传统和优良作风，深入学习贯彻落实十八届三中全会精神，进一步巩固和扩大党的群众路线教育实践活动成果，进一步增强基层党组织的凝聚力和战斗力，进一步增强党员的党性观念，更好的发挥党员的先锋模范作用，资产管理与后勤处按照《校部机关党委关于开展纪念建党93周年活动的通知》现在开展如下学习活动：<br />\r\n1.重温入党誓词<br />\r\n我志愿加入中国共产党， 拥护党的纲领，遵守党的章程， 履行党员义务，执行党的决定，严守党的纪律，保守党的秘密，对党忠诚，积极工作， 为共产主义奋斗终身， 随时准备为党和人民牺牲一切，永不叛党。<br />\r\n2.学习党的群众路线教育专题片&mdash;&mdash;《为民 务实 清廉》<br />\r\n网络地址：http://www.iqiyi.com/w_19rr20k0jt.html<br />\r\n&nbsp;&nbsp;&nbsp;</span><br />\r\n&nbsp;<br />\r\n', '', '', '121.17.66.174');
