INSERT INTO `dede_addonarticle` VALUES (5780, 132, '<br />\r\n<br />\r\n<span style="font-size: 16px">&nbsp;&nbsp;&nbsp; 《吉林大学国有资产管理办法（修订）》于2014年7月25日经学校2014年第十三次校长办公会议审议通过，详情请见附件</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/140912/吉林大学国有资产管理办法.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/140912/吉林大学国有资产管理办法.doc" target="_blank"><u>吉林大学国有资产管理办法</u></a><br />\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '10.150.245.220');
INSERT INTO `dede_addonarticle` VALUES (5775, 109, '<br />\r\n<span style="font-size: 22px">&nbsp;&nbsp;&nbsp; 为进一步贯彻落实教育部有关文件精神，强化学校国有资产管理工作,7月3日吉林大学国有资产管理委员会（以下简称国资委）2014年第一次全体委员会议在东荣会议中心第一会议室召开。国资委各位委员参加了会议，经营性资产管理委员会（以下简称经资委）部分委员列席了本次会议。会议由国资委主任李元元校长主持。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 国资委主任李元元校长针对学校国有资产现状、国有资产管理工作取得的主要成效、存在的突出问题及今后工作思路向与会委员做了专题报告。李元元主任明确提出学校国有资产管理实行&ldquo;统一领导、归口管理、分级负责、责任到人&rdquo;的管理体制。国有资产管理工作意义重大，任务艰巨，学校党委对此高度重视，希望各位委员勇担责任，在进一步完善制度，落实责任，强化管理的基础上，不断改革创新，不辜负学校党委和师生员工的厚望。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 会上，国资委副主任杜莉总会计师宣读《吉林大学国有资产管理委员会议事规则》，并就文件形成的筹备情况和具体内容作了详细说明。国资委办公室主任赵伟处长就《吉林大学国有资产管理办法》的起草背景、依据、主要内容及征求意见情况向与会委员作了详细汇报。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 最后，与会委员对本次会议提交的各项议案充分发表意见，并进行投票表决。会议决议原则上通过了《吉林大学国有资产管理办法》和《吉林大学国有资产管理委员会议事规则》及经资委提交的三项议案，并就部分议案提出修改意见，择机提交校长办公会或党委常委会讨论。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 本次会议秩序井然，与会委员尽职尽责，表决程序公平公正，表决结果公开透明。本次会议是学校国资委成立后的首次大会，会议的召开实现了学校国有资产管理决策民主化、制度化、科学化，开创了学校国有资产管理工作的新局面，为进一步强化学校国有资产管理工作提供了有力保障。<br />\r\n&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n<div style="text-align: right">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 22px"> &nbsp;吉林大学国有资产管理委员会办公室<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;二〇一四年七月十日<br />\r\n	&nbsp;</span></div>\r\n', '', '', '10.150.101.77');
INSERT INTO `dede_addonarticle` VALUES (5782, 109, '<p>\r\n	校内各单位、相关教职工：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;我校将继续出售咖啡小镇剩余14套商品住房，《咖啡小镇住房出售方案》、《咖啡小镇剩余14套住房出售明细表》及《咖啡小镇购房申请表》详见附件，具体通知如下：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;一、符合出售范围第五批条件的职工（全校教职工），若有购买意向，请按照要求填写《咖啡小镇购房申请表》。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;二、交表地点：资产管理与后勤处房产管理办公室（中心校区商贸楼309室）</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;交表时间：2014年10月23、24、27日</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;联系电话：85166543</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;三、选房时间地点另行通知。</p>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/141023/4-141023145031.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/141023/4-141023145031.doc" target="_blank"><u>关于咖啡小镇住房出售方案</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/141023/4-141023145S2.xls" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/141023/4-141023145S2.xls" target="_blank"><u>咖啡小镇剩余14套房屋价格出售表</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/141023/4-141023150026.doc" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/141023/4-141023150026.doc" target="_blank"><u>咖啡小镇购房申请表</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n', '', '', '59.72.106.153');
INSERT INTO `dede_addonarticle` VALUES (5784, 109, '<p>\r\n	&nbsp;&nbsp;&nbsp;<span style="font-size: 18px">&nbsp; 10月31日，资产管理与后勤处在西区图书馆会议室召开了西区资产核查工作会议，西区各二级单位的资产管理责任人以及资产管理员等40余人参加了会议。</span></p>\r\n<p>\r\n	<span style="font-size: 18px">&nbsp;&nbsp;&nbsp;&nbsp;会议由西区综合办副主任林森主持。资产管理与后勤处副处长高殿国作动员讲话，资产管理与后勤处固定资产科科长贺淑娟传达了西区资产核查工作程序及要求，西区党工委书记杨振明对西区各部门提出了具体要求。</span></p>\r\n<p>\r\n	<span style="font-size: 18px">&nbsp;&nbsp;&nbsp;&nbsp;本次会议通过工作动员、方案部署，下发了各部门资产数据，要求西区各单位、各部门按照学校要求完成自查任务。希望通过此次核查健全资产管理体制，完善学校国有资产管理体制和制度，保证国有资产的安全、完整、合理配置及有效利用。</span></p>\r\n<h2>\r\n	<br />\r\n	<img alt="" src="/uploads/141104/4-141104133004201.jpg" style="height: 368px; width: 521px" /></h2>\r\n<br />\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '', '', '10.150.106.226');
INSERT INTO `dede_addonarticle` VALUES (5785, 109, '<span style="font-size: 16px">校内各相关单位：<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为加强公用房管理信息化建设，我处已完成公用房信息管理平台的开发、数据录入、网上申报运行等工作。经研究，定于2014年11月26日在全校开始启用。同时，决定在全校范围内开展公用房数据核对工作，具体相关事宜通知如下：<br />\r\n<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 一、使用单位的范围及时间</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (一) 使用单位范围：全校范围内各教学单位及独立科研机构，对各单位所使用的吉林大学公用房产以房间为单位核对使用单位、使用性质及使用人等相关信息。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (二) 时间：2014年12月1日起，&ldquo;公用房信息管理平台&rdquo;正式启用。<br />\r\n<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 二、相关工作要求</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 各单位要高度重视、认真组织，确保公用房信息管理系统良好运用，并将核对工作落实到位，保证数据详实、准确。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;（一）确保&ldquo;公用房信息管理平台&rdquo;良好的运行环境。各单位要确保有一台能够正常运用&ldquo;公用房信息管理平台&rdquo;的计算机，专人负责，即时上网更新信息。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （二）&ldquo;公用房信息管理平台&rdquo;权限工作。各单位资产管理员到资产管理与后勤处主页下载公用房管理客户端（附件），到公用房管理科领取各单位用户名与密码。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （三）确定各级管理及操作人员。各单位要保证一名人员参加资产管理与后勤处召开的专题培训会，为各单位公用房信息系统顺利、安全使用奠定基础。（培训时间定为<u>1</u>1月26日星期三下午13：30，东荣大厦多功能厅）。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （四）做好数据核对工作。为确保公用房信息数据全面、准确，为各级领导决策和工作开展提供依据，各单位对已录入的数据进一步核实，按&ldquo;公用房信息管理平台&rdquo;的要求，认真填报。<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （五）按时完成数据录入。各单位相关人员培训完成后一周内开始启用&ldquo;公用房信息管理平台&rdquo;，基础信息核对、录入时间为12月1日至12月30日。<br />\r\n<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三、说明及联系方式</strong><br />\r\n尚未开展公用房普查工作的校区（如西区），要按照&ldquo;公用房信息管理平台&rdquo;的选项，如实上报，待日后核查。<br />\r\n联 系 人：马鑫磊、解丹<br />\r\n联系电话：85166989&nbsp; 85152166<br />\r\n&nbsp;</span><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n<table width="450">\r\n	<tbody>\r\n		<tr>\r\n			<td height="30" width="20">\r\n				<a href="/uploads/soft/141125/12.zip" target="_blank"><img align="middle" alt="" border="0" src="/plus/img/addon.gif" /></a></td>\r\n			<td>\r\n				<a href="/uploads/soft/141125/12.zip" target="_blank"><u>公用房管理系统</u></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n', '', '', '211.151.238.52');
