INSERT INTO `dede_addonsoft` VALUES (5685, 153, '.rar', '简体中文', '国产软件', '共享软件', '', 3, '', '', '0.03 MB', '{dede:link islocal=\'1\' text=\'吉林大学大功率电器设备购置审批表\'} /uploads/soft/130813/1-130Q3102438.doc {/dede:link}\r\n', '<strong>填表说明：</strong><br />\r\n1.本表用于空调机、电暖气及功率在1000W以上电器；<br />\r\n2.申请理由详细说明该设备的用途、必要性及使用的具体地点；<br />\r\n3.主管单位意见：用于教学的电器设备由教务处签署意见、用于科研的电器设备科学技术处或社会科学处签署意见；<br />\r\n4.用电容量审核：资产管理与后勤处工程科审核；<br />\r\n5.申报的内容文字须打印。<br />\r\n<br />\r\n', 0, 0, '', '211.151.238.51', '');
