INSERT INTO `dede_addonsoft` VALUES (5728, 141, '.rar', '简体中文', '国产软件', '共享软件', '', 3, '', '', '0.03 MB', '{dede:link islocal=\'1\' text=\'文件呈报单\'} /uploads/soft/131107/文件呈报单.doc {/dede:link}\r\n', '&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;由于工作需要，我处需呈报主管校长签批的文件较多，为简化签批程序，提高工作效率，现将《文件呈报单》共享与处内网站（见附件），请大家按需下载，需要呈报的文件需先填写好文件标题及主管副处长意见后，交由综合科统一呈报。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 备注:日期及编号由综合科统一编号填写。<br />\r\n<br />\r\n<br />\r\n', 0, 0, '', '211.151.238.51', '');
