INSERT INTO `dede_arctype` VALUES (104, 0, 0, 70, '关于我们', '{cmspath}/a/guanyuwomen', 1, 'AboutUs.htm', 1, 1, -1, 0, 0, 'default/AboutUs.htm', 'default/AboutUs.htm', 'default/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '{cmspath}/a/guanyuwomen', '', 0, 0, '', '<div id="listBottom">\r\n	<p>\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="color: #add8e6"><span style="font-size: 16px">&nbsp;&nbsp;&nbsp; &nbsp;</span></span><span style="font-size: 18px"><span style="font-family: arial,helvetica,sans-serif"><span style="color: #3399ff">吉林大学资产管理与后勤处自2012年12月成立，由吉林大学后勤处、国有资产处、国土资源管理办公室合并而成。全处共有员工56人，下设：综合管理科、数据管理科、工程管理科、动力管理科、校园管理科、爱卫会办公室、固定资产管理科、机动车辆管理科、无形资产管理科、产权管理科、公用房管理科、国土资源管理办公室等十二个科室，节能办公室和房产管理办公室两个副处级部门。<br />\r\n		<br />\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;吉林大学资产管理与后勤处作为学校国有资产管理和后勤管理部门，在学校党委和行政领导下，贯彻执行国家及地方有关资产管理、土地资源开发及住房改革原政策，按照学校发展规划和对学校资源合理有效配置的原则，参与学校有关资产管理与后勤发展规划、年度计划等重大问题的讨论、研究和决策，建立健全学校国有资产管理和后勤保障的各项规章制度，为广大师生教职员工提供优质的服务，代表学校对后勤工作进行监督和管理，为学校的教学、科研的发展提供强有力的保障。</span></span></span></p>\r\n	<p>\r\n		<span style="font-size: 18px"><span style="font-family: arial,helvetica,sans-serif"><span style="color: #3399ff">&nbsp;</span></span></span></p>\r\n	<p>\r\n		&nbsp;</p>\r\n</div>\r\n', '');
